('52df8f41134b62a031b2d3a4c3fc7cd2', '208.101.7.44', 'Disqus/1.0', 1531573527, 'a:3:{s:9:"user_data";s:0:"";s:6:"events";N;s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"19";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:9:"Pika Pika";s:11:"product_url";s:35:"pikachu pokemon anime t shirt india";s:13:"product_intro";s:136:"Wear this amazingly cute pikachu t shirt and get ready to hear people around you yell "I chose you". Also don''t forget to say Pika Pika.";s:12:"product_desc";s:1424:"When we first got the challenge of creating a tee inspired from the most legendary anime of our time, we knew it wasn''t an easy task. Yes, obviously we can create a yet another poke tee, but we wanted you guys to actually feel that particular pocket monster''s power run through your blood, when wearing that tee and we knew for that, we will need help from the one of the greatest trainer ever.<br><br>\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from the most beloved pocket monster which they then infused with the t-shirt material from which this epic tee is created.<br><br>\nNote : Please don''t believe everything you read on the internet.<br><br>\nLet us know which other designs would you love to catch. <br><br>\n\nThis anime t shirt is screen printed on a 100% cotton golden yellow colored psycho store t shirt.<br><br>\nThis is a fan art/parody design and not official merchandise.";s:18:"product_image_path";s:29:"images/product/19/pikachu.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:3:"338";s:12:"product_date";s:19:"2016-05-10 12:24:28";s:19:"add_to_cart_comment";s:41:"Psycho Store : Pika Pika, Pikachuuuuuuuu!";s:13:"product_state";s:4:"live";s:7:"hashtag";s:14:"psychopikapika";s:8:"featured";s:1:"1";s:8:"category";s:5:"Anime";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"19";s:10:"product_id";s:2:"19";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:2:"10";s:9:"large_qty";s:2:"10";s:6:"xl_qty";s:2:"10";s:13:"size_preorder";s:1:"0";}}}}'),
('67a05964df675b44b24ba4ce99580977', '103.5.133.57', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.99 Safari/537.36', 1531573499, 'a:7:{s:9:"user_data";s:0:"";s:6:"events";N;s:12:"redirect_url";s:9:"checkout/";s:15:"recently_viewed";a:1:{i:0;a:18:{s:10:"product_id";s:2:"19";s:12:"product_type";s:6:"tshirt";s:9:"design_id";s:2:"19";s:12:"product_game";s:7:"Pokemon";s:12:"product_name";s:9:"Pika Pika";s:11:"product_url";s:35:"pikachu pokemon anime t shirt india";s:13:"product_intro";s:136:"Wear this amazingly cute pikachu t shirt and get ready to hear people around you yell "I chose you". Also don''t forget to say Pika Pika.";s:12:"product_desc";s:1424:"When we first got the challenge of creating a tee inspired from the most legendary anime of our time, we knew it wasn''t an easy task. Yes, obviously we can create a yet another poke tee, but we wanted you guys to actually feel that particular pocket monster''s power run through your blood, when wearing that tee and we knew for that, we will need help from the one of the greatest trainer ever.<br><br>\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from the most beloved pocket monster which they then infused with the t-shirt material from which this epic tee is created.<br><br>\nNote : Please don''t believe everything you read on the internet.<br><br>\nLet us know which other designs would you love to catch. <br><br>\n\nThis anime t shirt is screen printed on a 100% cotton golden yellow colored psycho store t shirt.<br><br>\nThis is a fan art/parody design and not official merchandise.";s:18:"product_image_path";s:29:"images/product/19/pikachu.png";s:13:"product_price";s:3:"499";s:16:"product_qty_sold";s:3:"338";s:12:"product_date";s:19:"2016-05-10 12:24:28";s:19:"add_to_cart_comment";s:41:"Psycho Store : Pika Pika, Pikachuuuuuuuu!";s:13:"product_state";s:4:"live";s:7:"hashtag";s:14:"psychopikapika";s:8:"featured";s:1:"1";s:8:"category";s:5:"Anime";s:15:"product_details";a:7:{s:9:"tshirt_id";s:2:"19";s:10:"product_id";s:2:"19";s:9:"small_qty";s:1:"5";s:10:"medium_qty";s:2:"10";s:9:"large_qty";s:2:"10";s:6:"xl_qty";s:2:"10";s:13:"size_preorder";s:1:"0";}}}s:13:"cart_contents";a:4:{s:32:"ea88d27c781a35364fe770ba10bb03cc";a:8:{s:5:"rowid";s:32:"ea88d27c781a35364fe770ba10bb03cc";s:2:"id";s:2:"19";s:3:"qty";s:1:"1";s:5:"price";s:3:"499";s:4:"name";s:9:"Pika Pika";s:4:"type";s:6:"tshirt";s:7:"options";a:1:{s:5:"extra";s:6:"Medium";}s:8:"subtotal";i:499;}s:11:"total_items";i:1;s:10:"cart_total";i:499;s:11:"final_price";d:499;}s:8:"discount";a:2:{s:10:"percentage";i:0;s:6:"coupon";N;}s:6:"txn_id";s:8:"5b49f526";}'),
