INSERT INTO `feedback` (`id`, `name`, `email`, `message`, `time`, `publish`) VALUES
(11, 'ishkaran', '', 'Hey guys, at psycho store. You doing awesome work, love your site designs and the gimmicks in it. (thumbs up)', '2015-05-31 14:04:00', 0),
(12, 'AsS^Ss!n', '', 'Fuck off guys, Such costly stuff. Just fuck off.', '2015-05-31 14:04:45', 0),
(13, 'gamer', '', 'Finally a nice gaming merchandise site. So happy with it.\nAnyways can you please get Assassins creed designs. i love that game', '2015-05-31 14:05:49', 1),
(14, 'Gaminpsycho', 'ishkaran.singh@hotmail.com', 'Yo Yo codinpsycho, who are you??\nI wanna date you. :) :)', '2015-05-31 14:10:44', 0),
(15, 'ishu', 'ishkaran.singh@hotmail.com', 'Here take it, I am saying something, enjoy it savour it.', '2015-05-31 20:34:13', 0),
(16, 'chota bheem', 'ishkaran.singh@hotmail.com', 'Love the disqus feature on the site and yes the feedback wall as well.\nP.S. Half-life tshirt design is the best. \nKeep up the good work :)', '2015-06-01 08:22:18', 0),
(17, 'ishu', 'ishkaran.singh@hotmail.com', 'Hey there !', '2015-06-01 10:43:06', 0),
(18, 'anonymousq', 'csa@gmail.com', 'change Bangaluru to Bengaluru in return address', '2015-07-13 20:59:13', 0),
(19, 'sauravvinocha', 'sauravvinocha@yahoo.com', 'Nice place to buy COOL stuff. The entire theme is about mission games don''t you like racers :/ ...\nThe best part is, buying stuff on this portal is as easy as a knife on butter.\n**KEEP ROCKING.**', '2015-08-14 07:27:38', 1),
