(1, 'tshirt', 1, 'Programming', 'Codemonk', 'oldmonk programming t shirt india', 'Be a codemonk. Code just like an oldmonk would.', 'Behold the almighty header file that can solve all compiler or linker  errors, even track down those pesty memory leaks or those multithreading deadlocks. this header file has it all. Any damn kind of error and you know what to do, right? just include this header file and your code will run all neat and clean.\n<br>But wait, we thought, what about real life problems like gf/bf issues, financial issues, family issues etc etc? What if we can include this header file in real life as well and solve all those bugs as well? And here we are with this almighty tshirt to solve all our bugs and problems in real life as well.<br>Be a codemonk, code your life just like an oldmonk would.<br><br>\nDo let us know what kind of bugs this header file solved for you in the comments below.\n<br><br>\nThis programming t shirt is screen printed on a 100% cotton black colored psycho store tshirt.', 'images/product/1/codemonk.png', 499, 73, '2015-05-24 10:49:04', 'Psycho Store : This header file would solve all your bugs, trust us, it solves ours also.', 'live', 'psychocodemonk', 1, 'Programming'),
(2, 'tshirt', 2, 'Naruto', 'Akatsuki', 'akatsuki naruto anime t shirt india', 'Wear this t-shirt and be a part of one of the most feared, as well as respected enemy league known to mankind, the akatsuki..', 'So you want to achieve ultimate peace in this pitiful world full of hatred? If yes, then we have the ideal tshirt for you.<br>\njust find six others like you and form the legendary enemy league ''Akatsuki'' feared and respected by all. Go out there and capture all those jinchurikis roaming here and there. Harvest their power and achieve your dream.<br><br>\nNote : (our lawyers and legal team forced us to add this thing here) We shall not be held responsible in any way whatsoever for any kind of attack or injuries that may be inflicted on you while wearing this tshirt. Always remember a shinobi never lets his/her guard down.<br><br>\nLet us know about your real life akatsuki experiences in the comments below.\n<br><br>This naruto akatsuki t shirt is screen printed on a 100% cotton black colored psycho store tshirt.', 'images/product/2/akatsuki.png', 499, 110, '2015-05-24 10:52:33', 'Psycho Store : just imagine, 7 like you walking together, wearing this tshirt.', 'live', 'psychoakatsuki', 1, 'Anime'),
(3, 'tshirt', 3, 'Portal', 'Infinite loop', 'portal infinte gaming t shirt india', 'Take a sip from this portal gaming coffee mug before you go out for your routine tests. Cake and grief counselling will be available at the conclusion of the test - GLaDOS.', 'Chell : "you know it will be real fun to create two portals one over another, it will just act like an infinite loop".<br>\nGLaDOS : "Well not for me, you see, your entire life has been a mathematical error... a mathematical error I''m about to correct!"<br>\nChell : "All you earthlings safe from the clutches of aperture science, wear this t-shirt and show your support for me as i fight my way through test chambers in search of the cake and to destroy GLaDOS(Genetic lifeform and disk operating system)."<br>\nGLaDOS : "In the end, you will be baked and there will be a cake."\n<br><br>\nPsycho Store : "This was the last message that we intercepted from aperture science, chell has asked us to create this t-shirt so that you all can wear it and show her your support. Now don''t disappoint her. Wear it with pride and take to the streets to oppose the atrocities of aperture science and GLaDOS."\n<br><br>\nLet us know your favorite GLaDOS quotes and moments from portal series in the comments below.\n<br><br>\nThis portal gaming t shirt is screen printed on a 100% cotton white colored psycho store tshirt.', 'images/product/3/portal_fall.png', 499, 185, '2015-05-24 10:54:26', 'Psycho Store : We need to show our support for Chell now, more than ever.', 'live', 'psychoportal', 1, 'Gaming'),
(4, 'tshirt', 4, 'Programming', 'Bug Fixing', 'bugs programming t shirt india', 'Is that bug fixed?', 'You do one more edit and you are sure the bug is solved, you hit F5, compiling ... linking .. and boom the program starts, but damn the bug is still there. You get up from your seat longing for some brain food(caffeine), frustrated but still thinking about the flow of the code and where its going wrong, you move towards coffee machine and there they are, your friends talking about the pc launch of GTA V and their current progress in Witcher 3 and suddenly your train of thought gets derailed and you start asking "Whats the fps? whats the resolution? blah? blah?" and when you again get wired-in with your brain food(caffeine) in your hand, you know how fucked up you are, now that you have to get that derailed train of thought back on track again. You sigh! and start again.<br>But you know what, all this could have been avoided if only you were to wear this magical tshirt. This tshirt creates an invisible barrier around you and prevents any distracting thoughts to enter your mind, so you can keep focusing on your code. We desperately needed one so we made one for ourselves and you of course.<br><br>added benefits include but not limited to :<br>\n1. Motivates you beyond power level 9000 when you look at yourself in the mirror.<br>\n2. Keeps useless people away, can be used as a sign for others to let them know that you are on a serious bug hunt.<br>\n3. Keeps your manager/lead happy that you are working on a bug.<br>\n4. Since you are solely focused on bug fixing, bug actually gets fixed from the root without causing any side bugs.<br>\n5. Greatly reduces your debugging time.<br>\n6. Most importantly, after having so many bug fixes to your credit, you get a good appraisal as well.\n<br><br>Let us know about your bug hunting experiences in the comments below and happy debugging.<br><br>\nThis bug fixing programming t shirt is screen printed on a 100% cotton black colored psycho store tshirt.', 'images/product/4/latmwb.png', 499, 39, '2015-05-24 10:57:05', 'Psycho Store : Happy debugging !', 'live', 'psychodebugging', 0, 'Programming'),
(5, 'tshirt', 5, 'Dota', 'The Dota Loop', 'dota loop gaming t shirt india', 'eat sleep dota repeat, need i do anymore?', 'To achieve nirvana in life all you need is blah blah blah blah. Just replace blah blah blah blah with eat sleep dota repeat and thats it, believe me you are all set for a life full of happiness.\n<br><br>\nDo let us know which dota hero''s tshirt you would like to have in the comments below.\n<br><br>\nThis dota gaming t shirt is screen printed on a 100% cotton black colored psycho store tee.', 'images/product/5/esdr.png', 499, 72, '2015-05-24 10:58:48', 'Psycho Store : Wear this on a first date, you will rock. Believe me.', 'live', 'psychodotaloop', 0, 'Gaming'),
(6, 'tshirt', 6, 'Contra', 'S Power', 'contra s power gaming t shirt india', 'Best power up in the history of video games. Period.', 'If you can recognize this print, we have nothing but utmost respect for you. This thing right here is the reason for some of the most memorable memories of our childhood. Recall that invincible  feeling that we felt on getting this S power, the feeling that there''s no stopping us now. Lets get that adrenaline rush, that invincible feeling once again. Wear this s power tshirt in real life and pay your homage to one of the best game out there and once again, be invincible.<br><br> For those who missed out on this, well here''s your chance to pay some respect to where it all began, <a target="_blank" href="https://en.wikipedia.org/wiki/Contra_(video_game_series)">Contra.</a><br><br>P.S :  Those who thought this is some pixelated superman stuff, just letting you know our assassin minions are on their way.<br>\nLet us know in the comments below what you think about this power or any other power that you think is comparable to this.\n<br><br>\nThis contra s power gaming t shirt is screen printed on a 100% cotton black colored psycho store tee.', 'images/product/6/spower.png', 499, 55, '2015-05-24 11:00:17', 'Psycho Store : Have fun spreading your ''S Power''  all over the place.', 'live', 'psychospower', 0, 'Gaming'),
(7, 'tshirt', 7, 'Half Life', 'Gravity Gun', 'half life gravity gun gaming t shirt india', 'The best weapon that you ever held in your hands now printed on a t shirt for you to wear and become the epicenter of envy among all half-life fans.', 'We have nothing but utmost respect for eli vance, for creating zero point energy field manipulator, most commonly knows as the gravity gun, which is a tractor beam-type weapon that was originally designed for handling hazardous materials, but, as alyx stated, was primarily used for heavy lifting. At its core is a substance that appears to be a xen crystal. The good news is that this t-shirt is not as heavy as the gun that alyx struggles to lift and you don''t need an hev suit to wear it.<br>\nSo wear this t-shirt and pay your tribute to half-life, one of the best games ever made and to that one free man - gordon freeman.<br>\nOh and keep praying for half-life 3.<br><br>\nLet us know what you think in the comments below, which are the most epic weapons in your opinion.\n<br><br>This half life gaming t shirt is screen printed on a 100% cotton black colored psycho store tee.', 'images/product/7/gg.png', 499, 112, '2015-05-24 11:01:30', 'Psycho Store : Keep praying for Half-Life 3, until then enjoy this gravity gun.', 'live', 'psychogravitygun', 0, 'Gaming'),
(8, 'tshirt', 8, 'Counter Strike', 'Bite de_dust', 'counter strike dust gaming t shirt india', 'Your favorite weapon ak 47, with your favorite map de_dust 2, need more reason to wear this counter strike t shirt? Well how about watching the world around you bite de_dust as you bask in your geek glory.', 'The match is on, map is de_dust_2 and there''s still 25 seconds to detonation and you are guarding the B site, waiting for CT''s to arrive and just then, you hear some footsteps. you slowly take cover as you are the only one left in T and there are still three CTs, you take a look at the window, BAM one down, flashbang in the air, but you evade, 2 more enter through doors, BAM! BAM! and both down. You win the round and become the hero, but no one knows your superpower and no it''s not your kinzu or deathadder mouse or the mousepad, it''s your special bite de_dust tshirt that gives you the power to BAM anyone when you have AK-47 in dust maps.<br><br>\nNote : Dont try this in office, train, nuke etc. This power works only in dust variant maps and dont keep this power to yourself get your whole team to wear it.\n<br><br>\nLet us know your views in the comments below.\n<br><br>\nThis counter strike de_dust t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/8/de_dust.png', 599, 232, '2015-10-02 01:58:49', 'Psycho Store : Wear this on a first date, if he/she doesnt get it, then you know its not worth it.', 'live', 'psychodedust', 1, 'Gaming'),
(9, 'tshirt', 9, 'Assassins Creed', 'Rest In Peace', 'assassins creed gaming tshirt india', 'Requiescat In Pace - Ezio Auditore da Firenze. The one quote thats really difficult to forget once you finish the best game of the assassins creed franchise.', 'The most iconic quote by the most iconic character in the whole Assassins Creed franchise, that stayed with us long after we finished the game, now printed on a tshirt for you to wear and show your support for the fight against injustice.<br><br>\nNote : If you are being attacked or followed by templars just sit in a nearby bench or start talking to some starngers, but whatever happens don''t tell them you got this t shirt from us.<br>\nCaution : Please don''t start jumping over buildings, this t shirt does not give magical parkour abilities and don''t even think about taking the leap of faith.<br><br>\nLet us know your views in the comments below.\n<br><br>\nThis assassins creed t shirt is screen printed on a 100% cotton white colored psycho store t shirt.', 'images/product/9/rip.png', 499, 121, '2015-10-24 20:35:47', 'Psycho Store : Ezio sends his regards for supporting his fight.', 'live', 'psychoezio', 0, 'Gaming'),
(10, 'tshirt', 10, 'Nothing', 'Flammable', 'flammable gaming tshirt india', 'Remember those cute explosive barrels placed around those harmless npc''s that you shoot once and everything goes booooom !! Well now, be one yourself.', 'So you are playing this game and there are tons of bad ass mercenaries running towards you with ak 47, bazookas and what not and suddenly you spot your savior, that red barrel with flammable written all over it. Just like a knee-jerk reaction you move your gun towards it, press the trigger and there it goes right in front of you, a huge explosion and all those mercenaries are now burning in hell.<br>So wear this t-shirt and pay your respect to all those explosive barrels who laid down their lives in order to save you or just to show you the explosion effects of the latest engine.<br>In the end don''t forget to thank that level editor for placing that priceless thing around those mindless NPC''s.<br><br>\nNote : Don''t start blaming us if people start acting very cautious around you or start carrying a fire extinguisher when around you. You knew what you were getting into. Also the t shirt comes soaked in petrol, to make it even more flammable. <br><br>\nLet us know your views in the comments below.\n<br><br>Screen printed on a 100% cotton red tshirt.', 'images/product/10/flammable.png', 499, 48, '2015-10-24 20:47:25', 'Psycho Store : Please read the tee carefully before applying any deo or perfume.', 'live', 'psychoflammable', 0, 'Gaming'),
(11, 'tshirt', 11, 'Star Wars', 'Star Wars Force Awakens', 'star wars force awakens t shirt india', 'The force is strong with this one. - Master Yoda. Wear this star wars t shirt and get the force on your side. Its yoda certified.', 'After the defeat of evil galactic forces, the whole universe was thunderously applauding  the victory of luke skywalker. But somewhere deep inside his heart luke was mourning for his father''s death.<br><br>\nLuke : Master, I have achieved what you wanted me to do, what you trained me for. But my mind is still restless.<br>\nyoda : much to learn you still have.<br>\nluke : but how can i battle this feeling?<br>\nyoda : Weapons dont win battles. your mind powerful, it is. A present is what you deserve.<br>\nluke : A present!! <br>\nyoda : go to planet dagobah, where you will find a grey box under my bed. they are your father''s possessions and peace you will find then.<br><br>\nLuke breathlessly sets course to dagaboh where he ultimately finds his father''s possessions and achieves inner peace.<br><br>\npsycho Store : We at psycho store are proud to present you the exact replica of the tshirt that luke found that day in his father''s possessions.\nSo embrace it with pride and achieve your inner peace and dont forget to fight the dark side.<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis star wars force awakens t shirt is screen printed on a 100% cotton black colored psycho store tshirt.', 'images/product/11/force.png', 499, 163, '2015-11-04 08:56:13', 'Psycho Store : May the force be with you !', 'live', 'psychoforceawakens', 1, 'Movies'),
(12, 'tshirt', 12, 'Fallout', 'Fallout Nuka Cola', 'nuka cola fallout gaming tshirt india', 'The most popular drink of the wasteland, now printed on a t shirt for you to wear and show your support for the post apocalyptic world and the vault boy. Never forget the vault boy..', 'We have utmost respect for <a target="_blank" href="http://fallout.wikia.com/wiki/John-Caleb_Bradberton">John-Caleb Bradberton</a> for inventing the most popular soft drink ever. Even after the great war, nuka cola remains the #1 drink of the post apocalyptic world. Even their bottle caps can be seen being used as a currency in the new world. <br>\nSince everyone knows the fact that "War, War never changes", we bring to you the ice cold version of this drink for you to chill and deal with the fact.\n<br><br>Wear this t shirt and pay your tribute to one of the best rpg game ever made, that has been training you for years in case an apocalyptic situation arises.\n<br><br>\nLet us know your best nuka cola moments in the comments below. <br><br>\nThis fallout nuka cola gaming t shirt is screen printed on a 100% cotton red colored psycho store t shirt.', 'images/product/12/4.png', 599, 90, '2015-12-04 06:53:55', 'Psycho Store : Enjoy the most popular ice cold drink of the wasteland!', 'live', 'psychonukacola', 0, 'Gaming'),
(13, 'tshirt', 13, 'Dragon Ball Z', 'Goku Kame Symbol', 'dragon ball z anime goku t shirts india', 'kaa-mee-haa-mee-haaaaaaa !!<br>Get this Goku inspired dragon ball z t shirt with Master Roshi''s symbol in the front and King kai''s symbol in the back.', 'We were actually going to make a Goku robe first, but we thought a tshirt would be much better for your wardrobe.<br> So wear this with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\nI dont think we need to tell you what your power level will be after wearing this tshirt, so wear this and we assure you that you will be able to face any damn thing in your life.\n<br><br>\nNote : Please dont come complaining back to us if you cant instantly transmit from one place to another, or if nothing happens when you shout kamehameha, be realistic guys, its just a t shirt after all.\n<br><br>\nLet us know your views in the comments below.\n<br><br>\nThis dbz goku kame t shirt is screen printed on a 100% cotton orange colored psycho store t shirt.', 'images/product/13/1.png', 499, 1009, '2015-12-04 06:57:03', 'Psycho Store : For some days when you need to go over power level 9000!', 'live', 'psychodbz', 1, 'Anime'),
(14, 'tshirt', 14, 'One Punch Man', 'OK.', 'one punch man ok anime t shirt india', 'We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by wearing this one punch man t shirt.', 'We tried a lot to make a t shirt that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative t shirt to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is wear this t shirt and say ok and believe us its gonna be all right.<br><br>\nLet us know your views of your ok moments in the comments below. <br><br>\n\nThis one punch man anime t shirt is screen printed on a 100% cotton golden yellow colored psycho store t shirt.', 'images/product/14/1.png', 499, 217, '2016-01-24 19:06:07', 'Psycho Store : Wear this on a first date, you will be ok.', 'live', 'psychoonepunch', 1, 'Gaming'),
(15, 'tshirt', 15, 'Mario', 'One Up T Shirt', 'mario one up gaming t shirt india', 'On the purchase of this mario one-up t shirt you get an additional you!', 'After years of extensive research, our scientists at psycho labs have finally cracked the formula that gave mario an extra life, equipped with this vital information our scientists have created this 1-up t shirt that will give you an extra life. So whatever the situation is, you can definitely count on this tee to give you 1-up. believe us this is psycho labs certified. <br><br>\n\nNote (our lawyers forced us to add this) : This description is supposed to be taken as a joke, don''t start banging your head against walls or start jumping down the clifs.\n<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis mario one up gaming t shirt is screen printed on a 100% cotton green colored psycho store t shirt.', 'images/product/15/1.png', 499, 49, '2016-01-24 19:12:27', 'Psycho Store : Be ready to witness another you.', 'live', 'psychooneup', 0, 'Gaming'),
(16, 'tshirt', 16, 'The Witcher 3', 'Witcher White Wolf', 'witcher 3 white wolf gaming t shirts india', 'Get your hands on this witcher inspired wild hunt t shirt, before you go hunting down those monsters in the jungle.', 'We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the t shirts itself so that all our fans can taste Geralt''s powers. <br><br>\nSo here you go guys, after shit load of hardwork we present to you this magical tee infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\n<br><br>\nLet us know your monster hunting experiences in the comments below. <br><br>\n\nThis withcer 3 gaming t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/16/4.png', 599, 272, '2016-02-28 19:26:27', 'Psycho Store : Time to go monster hunting, white wolf.', 'live', 'psychowhitewolf', 1, 'Gaming'),
(17, 'tshirt', 17, 'Programming', 'Coffee Stats', 'coffee stats programming t shirts india', 'I convert caffeine into code. what''s your super power? Wear this caffeine powered t shirt and enjoy the new you with enhanced stats.', 'Disclaimer : Following story is based on real life incidents<br><br>\nSo it had been almost 2 hours and i had absolutely no clue what and where it was going wrong. Basically i wanted to show a pop-up on a successfully applied cheat code, but instead i was getting a blank white colored pop-up. That''s it, no text inside. i tried everything, debugged the shit out of the code, but i just couldn''t figure out where was my text going!<br>\nSo finally,fully exhausted i went into the kitchen to make myself a cup of coffee while i think about the issue. Few sips down, i came back to my screen, opened my website and BAM! there it was, there was the problem right in front of me.<br><br>all my text was white colored<br><br>\nSo there I was, trying to display white colored text on a white colored pop-up, i don''t know what made me realize this, but right at that moment i decided that i need to make a tee to show off all the benefits of coffee.\nSo here is the future me fulfilling my promise.\n<br><br>\nLet us know what you convert caffeine into. <br><br>\n\nThis programming t shirt is screen printed on a 100% cotton royal blue colored psycho store t shirt.', 'images/product/17/1.png', 499, 92, '2016-03-07 16:57:17', 'Psycho Store : Time to convert caffeine into something useful.', 'live', 'psychocoffeestats', 1, 'Programming'),
(18, 'tshirt', 18, 'Metal gear Solid', 'Diamond Dogs', 'metal gear solid diamond dogs gaming t shirt india', 'True diamond dogs wear this metal gear solid t shirt. Are you one of them?', 'Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\nSo wear this tee with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis metal gear solid gaming t shirt is screen printed on a 100% cotton steel grey colored psycho store t shirt.', 'images/product/18/1.png', 499, 97, '2016-04-13 23:22:28', 'Psycho Store : True Diamond Dogs are hard to come by. Be one.', 'live', 'psychodiamonddog', 0, 'Gaming'),
(19, 'tshirt', 19, 'Pokemon', 'Pika Pika', 'pikachu pokemon anime t shirt india', 'Wear this amazingly cute pikachu t shirt and get ready to hear people around you yell "I chose you". Also don''t forget to say Pika Pika.', 'When we first got the challenge of creating a tee inspired from the most legendary anime of our time, we knew it wasn''t an easy task. Yes, obviously we can create a yet another poke tee, but we wanted you guys to actually feel that particular pocket monster''s power run through your blood, when wearing that tee and we knew for that, we will need help from the one of the greatest trainer ever.<br><br>\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a tee which after wearing, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from the most beloved pocket monster which they then infused with the t-shirt material from which this epic tee is created.<br><br>\nNote : Please don''t believe everything you read on the internet.<br><br>\nLet us know which other designs would you love to catch. <br><br>\n\nThis anime t shirt is screen printed on a 100% cotton golden yellow colored psycho store t shirt.<br><br>\nThis is a fan art/parody design and not official merchandise.', 'images/product/19/pikachu.png', 499, 338, '2016-05-10 19:24:28', 'Psycho Store : Pika Pika, Pikachuuuuuuuu!', 'live', 'psychopikapika', 1, 'Anime'),
(20, 'tshirt', 20, 'Counter Strike', 'Loser Buy A Defuser', 'loser buy a defuser counter strike gaming t shirt india', 'Dedicated to all those losers who never buy defusers. Always remember to wear this t shirt to a counter strike tournament as a reminder for you know who.', 'Based on real fictional events<br><br>\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always wear a t shirt that would remind everyone not to act like that loser and to buy a defuser.<br><br>\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to wear this tee and remind the whole world around you to always and always buy a defuser.<br><br>\nLet us know your bomb defusal moments in the comments below. <br><br>\n\nThis counter strike gaming t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/20/defuser.png', 499, 41, '2016-05-24 22:48:09', 'Psycho Store : Always a good thing to remind those losers. ', 'live', 'psycholoserdefuser', 0, 'Gaming'),
(21, 'tshirt', 21, 'Pokemon', 'Playing With Fire', 'playing with fire anime t shirt india', 'We shall not be held responsible if after wearing this t shirt you somehow evolve into a fire breathing person and become a lazy bum.', 'So it had been quite some time since we did any catching and we decided it was time to again go hunting. Turns out the luck was on our side and we managed to capture this beauty, yes you figured it out right. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates your emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\n<br><br>\nSo we thought chuck it, we will just capture the happy emotions from this cute little creature and infuse it into the t shirt and that is exactly what we did. So we assure you that after wearing this fiery t shirt, happiness is the only emotion you will feel.\n<br><br>\nThis anime tee is screen printed on a 100% cotton orange colored psycho store t shirt.<br><br>\nThis is a fan art/pardoy design and is not official merchandise.', 'images/product/21/charmander.png', 499, 94, '2016-08-22 23:12:45', 'Psycho Store : People will look at your back to see your flame.', 'live', 'beingcharmander', 0, 'Anime'),
(22, 'tshirt', 22, 'Counter Strike', 'Invisble Wings Jersey', 'counter strike invisble wings official jersey t shirt india', 'Show your support for team invisible wings by sporting their official jersey. These orders are fulfilled by the team invisible wings themselves.', 'Team Invisible Wings literally came out of nowhere and has shook the Indian e-sports community with their continuous stellar performances and wins. <br>\nBacked by the awesome guys at <a href="http://tranzeneca.com/" target="_blank">Tranzeneca Gaming</a>, we are sure they will set the esports world on fire in the coming future.<br><br>\nMeanwhile show your support by sporting their killer looking official jersey.\n<br><br>\nNote : These orders are fulfilled by Invisible Wings themselves and not by Psycho Store, but you can rest assured about the quality.\n<br><br>\nInivisble Wings official jersey is made by using a delicate balance of cotton and polyster and is not 100% cotton like other psycho store tees.\n<br><br>\nLet us know your views in the comments below.', 'images/product/22/1.png', 799, 27, '2016-08-28 19:18:48', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoiw', 0, 'Gaming'),
(23, 'tshirt', 23, 'Naruto', 'Kamui Mangekyo Sharingan', 'kamui mangekyo sharingan naruto anime t shirt india', 'Wear this naruto inspired t shirt to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.', 'Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\nWell, we are so excited to inform you that now you can actually own this power by wearing our kamui t shirt. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our tees.<br><br>\nThis naruto anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/23/kamui_sharingan.png', 499, 92, '2016-09-09 22:49:39', 'Psycho Store : Time to awaken your mangekyo sharnigan !!', 'live', 'psychokamui', 1, 'Anime'),
(24, 'tshirt', 24, 'Programming', 'Forever Alone', 'dates updates meme programming t shirt india', 'Wear this classic meme t shirt with pride and show the whole world how you rock your single life. Dedicated to all you single rockstars around.', 'It was late in the night and I was watching dragon ball super, since the episode was filler I could afford to divert some of my neurotic bandwidth towards my phone. I was kind of waiting for it to buzz for some time now, like no matter what you are doing, somehow in the back of your mind that process is running in asynchronous mode continuously polling your phoneto see if you have a notification or not. <br><br>\nSo much for all the books read on being in the now going to drain, how does people even manage to put that knowledge into practice is beyond me.\n<br>\nSo coming back to the topic, i unlocked my phone and there it was, a notification, but not the one I was waiting for.<br>\nMe : "Damn, just another update".<br>\nOpens the app and it was then when reality hit me. Unmatched.<br><br>\nLet us know your forever alone moments in the comments below .<br><br>\nThis meme programming t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/24/dates.png', 499, 21, '2017-02-12 19:56:55', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychodatesupdates', 0, 'Programming'),
(25, 'tshirt', 25, 'Pokemon', 'Water Splash', 'water splash anime t shirt india', 'Every time you don''t feel like taking a bath or if you are in dire need of water, you can always count on this water spewing t shirt fulfilling all your water requirements.', 'This happened when I was travelling through The Great Indian Thar desert on my newly bought royal enfield. But I couldn''t be more wrong about the harsh difficulties one faces in the desert and as everyone can guess I was in dire need of water, but i only had fire and electric based t shirts with me which obviously were useless for me at that moment.<br><br>\nIt was then and there that i decided that I need to keep a water spewing tee also with me if i need to continue my travelling escapades.<br>I notified my research team to again track down the greatest trainer and since we were on good terms from our last meeting he easily gave us access to whatever we required from which our scientists extracted some tissues and infused them into this awesome tee.<br><br>\nNote: no one was hurt in the making of this tee.<br><br>\nLet us know in the comments below which other designs you want to keep in your closet.<br><br>\nThis anime t shirt is screen printed on a 100% cotton turquoise colored psycho store t shirt.<br><br>\nThis is a fan art/parody design and is not official merchandise.', 'images/product/25/squirtle.png', 499, 84, '2017-02-16 08:20:00', 'Psycho Store : For all your water requirements will be fulfilled.', 'live', 'beingsquirtle', 1, 'Anime'),
(26, 'tshirt', 26, 'Pokemon', 'Bulbaaaa', 'bulbaa evergreen anime t shirt india', 'Somethings achieve evergreen status, for others here''s this ogranic green t shirt.', 'The same time when I realized that I need a water character t-shirt (read the product description of water splash tee if you still haven''t http://bit.ly/2layNL2 ), I thought hey why not get some greenry also, so that I can also rest in natural shade whenever I want to. I mean if i am gonna get some water then better to get both at once and not to keep on pestering one of the greatest trainer again and again.<br><br>\nSo here we are to satisfy all your green needs (pun intended)<br>\nYes, I did get my scientists to inject organic greenry for our pot lover friends in this tee. yes I can hear you screaming with joy over the analytics screen<br>\nYou can always thank me later after you get the tee.<br><br>\nNote : Don''t believe everything you read on the internet.<br><br>\nLet us know in the comments below which other designs you want to keep in your closet.<br><br>\nThis anime t shirt is screen printed on a 100% cotton green colored psycho store t shirt.<br><br>\nThis is a fan art/parody design and is not official merchandise.', 'images/product/26/bulbasaur.png', 499, 63, '2017-02-16 08:46:53', 'Psycho Store : Taste some organic greenry whenever wherever.', 'live', 'psychobulbaaa', 0, 'Anime'),
(27, 'tshirt', 27, 'Nothing', 'Otaku At Heart', 'otaku at heart anime t shirt india', 'Grab this otaku t shirt and show the whole world where your heart really is. A true otaku just cannot miss this design.', 'It''s tough, it''s really tough to explain the world what we truly are, deep down in our hearts what we truly desire. This t-shirt is just one way to let the whole world know what you crave for. We made this design for all those true otaku heads that need to show their love for this amazing culture by donning this tee.<br><br>\nAlthough we are aware that for most, you will just end up explaining what this word actually means and if this even is an actual word or not, but hey whatever helps in spreading this culture.<br>\nFor those interested here''s a link for clarification <a target="_blank" href="https://en.wikipedia.org/wiki/Otaku">Otaku? what''s that?</a><br><br>\nLet us know your views in the comments below.<br><br>\nThis otaku anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/27/otaku.png', 499, 17, '2017-02-27 21:33:51', 'Psycho Store : A true otaku found !!', 'live', 'psychootakuatheart', 0, 'Anime'),
(28, 'tshirt', 28, 'One Piece', 'Luffys Gatling Gun', 'luffys gatling gun one piece anime t shirt india', '"gommu gommu no gatling" - Monkey D. Luffy. Grab this one piece t shirt with one of the most inconic attack from everyone''s favorite straw hat man.', 'Honestly, there have been countless instances where I wished I had this gatling gun power of luffy at my disposal, times when you just cannot control your rage and feel like punching endlessly.  So when introducing the one piece tee for the first time I knew that it had to somehow give me this ability. <br>\nFollowing are just some of the situations where this t shirt can be useful for you :\n<br><br>\n1. Losing a fifa match or ball hitting the goal post again and again.<br>\n2. Your team mates playing shit in counter strike / dota. <br>\n3. Your  boss/client talking non sense and not making any sense. <br>\n4. Not able to find that one annoying bug no matter how much you debug. <br>\n5. Video keeps buffering while watching your favorite thing.<br>\n5. Getting killed because of lag. <br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know in the comments below about more situations where you might prefer to use this attack. <br><br>\nThis one piece anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/28/gatling_gun.png', 599, 27, '2017-03-18 21:39:00', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psycholuffygatling', 0, 'Anime'),
(29, 'tshirt', 29, 'Half Life', 'Black Mesa Research Facility', 'black mesa research facility half life gaming t shirt india', '"Good morning and welcome to the black mesa transit system. Please wear this t-shirt at all times while handling any hazardous materials for your own safety." - Black mesa announcement system.', 'After the infamous <a href="http://combineoverwiki.net/wiki/Black_Mesa_Incident">black mesa incident</a>, we were approached by the black mesa management to create a special tee which would protect the scientists in case a similar incident was to happen again (and we were thinking "yeah right as if you really care about the scientists, we know what you did back then").<br>\nBut anyway business is business, so we accepted the offer, they obviously gave us some special chemical and xen substances to integrate in the t-shirt using which we made this half-life t-shirt which is in front of you.<br><br>\nWith much effort and special thanks to our business dev team we struck a deal with them where in we got the liberty to provide it to all our fans as well, just in case the next incident was to happen on a much larger scale (see how much we care about you guys).<br>\nDo wear this black mesa t-shirt at all times while handling any kind of hazardous materials.<br><br>\nLet us know your views in the comments below.<br><br>\nThis Half-life inspired gaming t shirt is screen printed on a 100% cotton white colored psycho store t shirt.', 'images/product/29/black_mesa.png', 599, 43, '2017-03-19 20:22:16', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoblackmesa', 1, 'Gaming'),
(30, 'tshirt', 30, 'Overwatch', 'Die Die Die', 'reaper walks overwatch gaming t shirt india', 'Watch everyone around you run for cover as you walk around like death, wearing this overwatch reaper t shirt. Just don''t start yelling die, die, die yourself, let reaper do the talking.', 'I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\nReaper : "I heard you are launching a new overwatch inspired t shirt?"<br>\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\nReaper : "Can I know which hero are you chosing first?"<br>\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\nMe : "Die! Die! Die!"<br><br>\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know which hero you want us to design next.<br><br>\nThis overwatch inspired gaming t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.', 'images/product/30/overwatch_reaper.png', 599, 57, '2017-04-02 21:42:05', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychochibireaper', 0, 'Gaming'),
(31, 'mugs', 30, 'Overwatch', 'Die Die Die', 'overwatch reaper walks gaming coffee mugs india', 'Watch everyone around you run for cover as you walk around like death, sipping your favorite drink from this overwatch reaper coffee mug. Just don''t start yelling die, die, die yourself, let reaper do the talking.', 'I still remember it like it happened just few minutes back. I was totally engrossed in programming when I heard that loud thud in my living room, it was 3 am in the night. It was pretty strange but still I went to see what was happening and to my astonishment I saw reaper standing there, like actually standing right in front of me. I was literally dumbfound and didn''t know how to react as I had played reaper before but he was not my first choice. But never imagined that it would bring him to me in reality. <br><br>\nReaper : "I heard you are launching a new overwatch inspired coffee mug?"<br>\nMe : "Wow! we didn''t knew we were so famous among overwatch heroes."<br>\nReaper : "Can I know which hero are you chosing first?"<br>\nMe : "Well honestly I am thinking of going with tracer since shes everyone''s heartthrob."<br>\nReaper : "I kneeeeeew it! You wouldn''t chose me. Anyway  I have a confession to make. I might come of as a really dark and strong character which I am btw, without a doubt. But still honestly I am also pretty soft at heart and I want you guys to help me change people''s perception of me by launching a cute but yet a strong design of mine."<br>\nMe : "Well, this actually sounds like a nice idea, I guess tracer can wait a bit. We can do this for you."<br>\nReaper : "Good, I will be looking forward to it and btw don''t forget to add my favorite line"<br>\nMe : "Die! Die! Die!"<br><br>\nSo here we are, finally fulfilling our promise to reaper who btw made us change the design n no. of times (hence the delay in launch). Believe us guys he is actually pretty soft at heart once he stops yelling.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know which hero you want us to design next.<br><br>\nThis overwatch inspired gaming coffee mug is digitally printed with alien printing technolgy.', 'images/product/31/reaper_right.png', 349, 0, '2017-04-20 22:24:41', 'Psycho Store : Die! Die! Die!', 'live', 'psychochibireapermug', 1, 'Gaming'),
(32, 'mugs', 19, 'Pokemon', 'Pika Pika', 'pikachu face anime coffee mug india', 'Give your mornings an electric boost by drinking from this amazingly cute pikachu coffee mug.', 'When we first got the challenge of creating a mug inspired from the most legendary anime of our time, we knew it wasn''t an easy task. Yes, obviously we can create a yet another poke mug, but we wanted you guys to actually feel that particular pocket monster''s power run through your blood, when wearing drinking from that mug and we knew for that, we will need help from the one of the greatest trainer ever.<br><br>\nIt was tough but finally our satellites were able to track him down, we wasted no time in reaching him and told him of our situation, that we wanted to create a mug from which after drinking, should give people the ability to use <a target="_blank" href="http://pokemon.wikia.com/wiki/Thunderbolt">thunderbolt</a> attack and the special <a target="_blank" href="http://pokemon.wikia.com/wiki/Static">static</a> ability. <br><br>\nThough it took some convincing but our marketing team (special bonus for them this year) was able to woo him into letting our scientists take some dna samples from the most beloved pocket monster which they then infused with the ceramic material from which this epic coffee mug is created.<br><br>\nNote : Please don''t believe everything you read on the internet.<br><br>\nLet us know which other designs would you love to catch. <br><br>\n\nThis anime coffee mug is digitally printed using alien technology..<br><br>\nThis is a fan art/parody design and not official merchandise.', 'images/product/32/pika_left.png', 349, 0, '2017-04-20 22:39:15', 'Psycho Store : Electric boost your morning coffee', 'live', 'psychopikapikamug', 1, 'Anime'),
(33, 'mugs', 28, 'One Piece', 'Luffys Gatling Gun', 'luffys gatling gun one piece anime coffee mug india', '"gommu gommu no gatling" - Monkey D. Luffy. Grab this one piece coffee mug with one of the most inconic attack from everyone''s favorite straw hat man.', 'Honestly, there have been countless instances where I wished I had this gatling gun power of luffy at my disposal, times when you just cannot control your rage and feel like punching endlessly.  So when introducing the one piece design for the first time I knew that it had to somehow give me this ability. <br>\nFollowing are just some of the situations where this t shirt can be useful for you :\n<br><br>\n1. Losing a fifa match or ball hitting the goal post again and again.<br>\n2. Your team mates playing shit in counter strike / dota. <br>\n3. Your  boss/client talking non sense and not making any sense. <br>\n4. Not able to find that one annoying bug no matter how much you debug. <br>\n5. Video keeps buffering while watching your favorite thing.<br>\n5. Getting killed because of lag. <br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know in the comments below about more situations where you might prefer to use this attack. <br><br>\nThis one piece anime coffee mug is digitally printed using alien technology.', 'images/product/33/gatling_gun_right.png', 349, 0, '2017-04-20 22:45:30', 'Psycho Store : gomu gomu no coffffeeeee', 'live', 'psychogatlinggunmug', 1, 'Anime');
