(34, 'mugs', 13, 'Dragon Ball Z', 'Goku Kame Symbol', 'dragon ball z anime goku coffee mug india', 'Take your first sip of the coffee from this dragon ball z inspired mug to keep your power level over 9000 for the whole day through.', 'After bring ing you the goku kame t shirt, we thought it is time to supercharge your mornings with this dragon ball z coffee mug.<br> So kickstart your mornings by drinking from this coffee mug with pride and show off the fact that you are a distinguished warrior who underwent training from both master Roshi and King Kai, mastering in techniques like kamehameha, spirit bomb and kaio-ken.<br>\nBut never ever forget, what these symbols actually stand for, remember what goku taught us in the childhood, to never give up in the face of adversties, to always believe in yourself, to always have faith in yourself and always fight for whats right and stand against injustice.\nMost importantly never forget that you can achieve any level and overcome any obstacle, given that you are ready to put in the required effort to achieve it.<br>\nI dont think we need to tell you what your power level will be after drinking from this mug, so go ahead take your first sip and we assure you that you will be able to face any damn thing in your life.\n<br><br>\nNote : Please dont come complaining back to us if you cant instantly transmit from one place to another, or if nothing happens when you shout kamehameha, be realistic guys, its just a coffee mug after all.\n<br><br>\nLet us know your views in the comments below.\n<br><br>\nThis dragon ball z goku kame coffee mug is digitally printed using alien technology.', 'images/product/34/goku_left.png', 349, 0, '2017-04-20 23:03:50', 'Psycho Store : Coffee to keep your power level over 9000 the whole day', 'live', 'psychodbzmug', 0, 'Anime'),
(35, 'mugs', 16, 'The Witcher 3', 'Witcher White Wolf', 'witcher 3 white wolf gaming coffee mugs india', 'Get your hands on this witcher inspired wild hunt coffee mug and drink those magic potions for added benefits, before you go hunting down those monsters in the jungle.', 'We were really thrilled to hear that our team finally got the chance to interview the legendary monster hunter Geralt Of Rivia aka White Wolf. We really wanted to know the secret behind his speed and reflexes and to our surprise he actually gave us some magical substances to get the taste of his powers firsthand. Our scientists were hard at work for past 6 months to figure out a way to infuse those substances in the coffee mugs itself so that all our fans can taste Geralt''s powers. <br><br>\nSo here you go guys, after shit load of hardwork we present to you this magical mug infused with white wolf''s power and abilities so that even you can enjoy monster hunting now.\n<br><br>\nLet us know your monster hunting experiences in the comments below. <br><br>\n\nThis witcher 3 gaming coffee mug is digitally printed using alien technology.', 'images/product/35/white_wolf_left.png', 349, 0, '2017-04-20 23:14:02', 'Psycho Store : Be a professional, drink from this white wolf mug', 'live', 'psychowhitewolfmug', 1, 'Gaming'),
(36, 'mugs', 2, 'Naruto', 'Akatsuki', 'akatsuki naruto anime coffee mugs india', 'Get this coffee mug and be a part of one of the most feared, as well as respected enemy league known to mankind, the akatsuki.', 'So you want to achieve ultimate peace in this pitiful world full of hatred? If yes, then we have the ideal coffee mug for you.<br>\njust find six others like you and form the legendary enemy league ''Akatsuki'' feared and respected by all. Go out there and capture all those jinchurikis roaming here and there. Harvest their power and achieve your dream.<br><br>\nNote : (our lawyers and legal team forced us to add this thing here) We shall not be held responsible in any way whatsoever for any kind of attack or injuries that may be inflicted on you while drinking from this mug. Always remember a shinobi never lets his/her guard down.<br><br>\nLet us know about your real life akatsuki experiences in the comments below.\n<br><br>This naruto akatsuki coffee mug is digitally printed using alien technology.', 'images/product/36/akatsuki_right.png', 349, 0, '2017-04-22 10:40:40', 'Psycho Store : You will achieve world peace one day.', 'live', 'psychoakatsukimug', 0, 'Anime'),
(37, 'mugs', 4, 'Programming', 'Bug Fixing', 'bug fixing programming coffee mugs india', 'Is that bug fixed? No? Take another sip from this mug.', 'You do one more edit and you are sure the bug is solved, you hit F5, compiling ... linking .. and boom the program starts, but damn the bug is still there. You get up from your seat longing for some brain food(caffeine), frustrated but still thinking about the flow of the code and where its going wrong, you move towards coffee machine and there they are, your friends talking about the pc launch of GTA V and their current progress in Witcher 3 and suddenly your train of thought gets derailed and you start asking "Whats the fps? whats the resolution? blah? blah?" and when you again get wired-in with your brain food(caffeine) in your hand, you know how fucked up you are, now that you have to get that derailed train of thought back on track again. You sigh! and start again.<br>But you know what, all this could have been avoided if only you were drinking from this magical coffee mug. It creates an invisible barrier around you and prevents any distracting thoughts to enter your mind, so you can keep focusing on your code. We desperately needed one so we made one for ourselves and you of course.<br><br>added benefits include but not limited to :<br>\n1. Motivates you beyond power level 9000 when you look at yourself in the mirror.<br>\n2. Keeps useless people away, can be used as a sign for others to let them know that you are on a serious bug hunt.<br>\n3. Keeps your manager/lead happy that you are working on a bug.<br>\n4. Since you are solely focused on bug fixing, bug actually gets fixed from the root without causing any side bugs.<br>\n5. Greatly reduces your debugging time.<br>\n6. Most importantly, after having so many bug fixes to your credit, you get a good appraisal as well.\n<br><br>Let us know about your bug hunting experiences in the comments below and happy debugging.<br><br>\nThis bug fixing programming coffee mug is digitally printed using alien technology.', 'images/product/37/bug_fixing_left.png', 349, 0, '2017-04-22 10:52:59', 'Psycho Store : Keep sipping from this bug until the bug is fixed.', 'live', 'psychobugfixingmug', 0, 'Programming'),
(38, 'mugs', 24, 'Programming', 'Forever Alone', 'dates updates forever alone meme programming coffee mugs india', 'Sip your coffee from this coffee mug with pride and show the whole world how you rock your single life. Dedicated to all you single rockstars around.', 'It was late in the night and I was watching dragon ball super, since the episode was filler I could afford to divert some of my neurotic bandwidth towards my phone. I was kind of waiting for it to buzz for some time now, like no matter what you are doing, somehow in the back of your mind that process is running in asynchronous mode continuously polling your phone to see if you have a notification or not. <br><br>\nSo much for all the books read on being in the now going to drain, how does people even manage to put that knowledge into practice is beyond me.\n<br>\nSo coming back to the topic, i unlocked my phone and there it was, a notification, but not the one I was waiting for.<br>\nMe : "Damn, just another update".<br>\nOpens the app and it was then when reality hit me. Unmatched. Looks at the coffee mug and takes another sip.<br><br>\nLet us know your forever alone moments in the comments below .<br><br>\nThis forever alone meme programming coffee mug is digitally printed using alien technology.', 'images/product/38/dates_right.png', 349, 0, '2017-04-22 11:12:30', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychodatesmug', 0, 'Programming'),
(39, 'mugs', 18, 'Metal Gear Solid', 'Diamond Dogs', 'metal gear solid diamond dogs gaming coffee mugs india', 'True diamond dogs drink from this metal gear solid coffee mug. Are you one of them?', 'Do you remember the time which started the era of private military organisations and diamond dogs (1984 - 1995) was at the forefront of it who were willing to take up unsavory jobs for the clients but still at the same time always managed to maintain pride in their work. Not just this they were led by one of the most charismatic leader ever, the venom snake.<br><br>\nSo always drink from this coffee mug with pride and show your support for those "dogs of war" and yes be a diamond dog yourself.<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis metal gear solid gaming coffee mug is digitally printed using alien technology.', 'images/product/39/dd_left.png', 349, 0, '2017-04-22 11:21:29', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychodiamonddogsmug', 0, 'Gaming'),
(40, 'mugs', 8, 'Counter Strike', 'Bite de_dust', 'bite de_dust counter strike gaming coffee mugs india', 'Your favorite weapon ak 47, with your favorite map de_dust 2, need more reason to sip from this counter strike coffee mug? Well how about watching the world around you bite de_dust as you bask in your geek glory.', 'The match is on, map is de_dust_2 and there''s still 25 seconds to detonation and you are guarding the B site, waiting for CT''s to arrive and just then, you hear some footsteps. you slowly take cover as you are the only one left in T and there are still three CTs, you take a look at the window, BAM one down, flashbang in the air, but you evade, 2 more enter through doors, BAM! BAM! and both down. You win the round and become the hero, but no one knows your superpower and no it''s not your kinzu or deathadder mouse or the mousepad, it''s your special bite de_dust coffee mug that gives you the power to BAM anyone when you have AK-47 in dust maps.<br><br>\nNote : Dont try this in office, train, nuke etc. This power works only in dust variant maps and don''t keep this power to yourself get your whole team to have it.\n<br><br>\nLet us know your views in the comments below.\n<br><br>\nThis counter strike de_dust coffee mug is digitally printed using alien technology', 'images/product/40/de_dust_left.png', 349, 0, '2017-04-22 11:28:44', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychodedustmug', 0, 'Gaming'),
(41, 'mugs', 5, 'Dota', 'Eat Sleep Dota Repeat', 'eat sleep dota repeat gaming coffee mugs india', 'eat sleep dota repeat, need i do anymore?', 'To achieve nirvana in life all you need is blah blah blah blah. Just replace blah blah blah blah with eat sleep dota repeat and thats it, believe me you are all set for a life full of happiness.\n<br><br>\nDo let us know which dota hero''s design you would like to have in the comments below.\n<br><br>\nThis dota gaming coffee mug is digitally printed using alien technology.', 'images/product/41/esdr_left.png', 349, 0, '2017-04-22 11:37:08', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoesdrmug', 0, 'Gaming'),
(42, 'mugs', 10, 'Nothing', 'Flammable', 'flammable gaming coffee mugs india', 'Remember those cute explosive barrels placed around those harmless npc''s that you shoot once and everything goes booooom !! Well now, hold one in your hand.', 'So you are playing this game and there are tons of bad ass mercenaries running towards you with ak 47, bazookas and what not and suddenly you spot your savior, that red barrel with flammable written all over it. Just like a knee-jerk reaction you move your gun towards it, press the trigger and there it goes right in front of you, a huge explosion and all those mercenaries are now burning in hell.<br>So drink your coffee from this mug and pay your respect to all those explosive barrels who laid down their lives in order to save you or just to show you the explosion effects of the latest engine.<br>In the end don''t forget to thank that level editor for placing that priceless thing around those mindless NPC''s.<br><br>\nNote : Don''t start blaming us if people start acting very cautious around you or start carrying a fire extinguisher when around you. You knew what you were getting into.<br><br>\nLet us know your views in the comments below.\n<br><br>This flammable gaming coffee mug is digitally printed using alien technology.', 'images/product/42/flammable_right.png', 349, 0, '2017-04-22 11:42:14', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoflammablemug', 0, 'Gaming'),
(43, 'mugs', 11, 'Star Wars', 'Star Wars Force Awakens', 'star wars force awakens coffee mugs india', 'The force is strong with this one. - Master Yoda. Sip your coffee from this star wars mug and get the force on your side. Its yoda certified.', 'After the defeat of evil galactic forces, the whole universe was thunderously applauding  the victory of luke skywalker. But somewhere deep inside his heart luke was mourning for his father''s death.<br><br>\nLuke : Master, I have achieved what you wanted me to do, what you trained me for. But my mind is still restless.<br>\nyoda : much to learn you still have.<br>\nluke : but how can i battle this feeling?<br>\nyoda : Weapons dont win battles. your mind powerful, it is. A present is what you deserve.<br>\nluke : A present!! <br>\nyoda : go to planet dagobah, where you will find a grey box under my bed. they are your father''s possessions and peace you will find then.<br><br>\nLuke breathlessly sets course to dagaboh where he ultimately finds his father''s possessions and achieves inner peace.<br><br>\npsycho Store : We at psycho store are proud to present you the exact replica of the coffee mug that luke found that day in his father''s possessions.\nSo embrace it with pride and achieve your inner peace and don''t forget to fight the dark side.<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis star wars force awakens coffee mug is digitally printed using alien technology.', 'images/product/43/star_wars_left.png', 349, 0, '2017-04-22 11:51:53', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoforcemug', 1, 'Movies'),
(44, 'mugs', 23, 'Naruto', 'Kamui', 'kamui naruto kakashi obito sharingan anime coffee mugs india', 'Take a sip from this naruto inspired coffee mug to awaken the mangekyo sharingan inside you and gain the special ability of kamui just like obito and kakashi had.', 'Ever since we came to know about the special and eternal power of mangekyo sharingan, we wanted one for ourself, but the icing on the cake was when we came to know about ''Kamui''. The special sharingan ability which can transfer people or best of all yourself to another dimension.<br><br>\nJust imagine being stuck with your boss or even gf/bf blabbering about this and that and poof! you are gone. Solves just so many of our problems, right?<br>\nWell, we are so excited to inform you that now you can actually own this power by getting our kamui coffee mug. We went to great lengths and put in a lot of effort to make sure this power comes to each and every one of us who has the will to awaken his/her mangekyo sharingan.<br><br>\nLet us know in the comments below which other powers/abilities you would like to gain and we will make sure to put them on our merchandises.<br><br>\nThis naruto anime coffee mug is digitally printed using alien technology.', 'images/product/44/kamui_right.png', 349, 0, '2017-04-23 06:07:41', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychokamuimug', 0, 'Anime'),
(45, 'mugs', 7, 'Half Life', 'Gravity Gun', 'gravity gun half life gaming coffee mugs india', 'The best weapon that you ever held in your hands now printed on a mug for you to drink your coffee from and become the epicenter of envy among all half-life fans.', 'We have nothing but utmost respect for eli vance, for creating zero point energy field manipulator, most commonly knows as the gravity gun, which is a tractor beam-type weapon that was originally designed for handling hazardous materials, but, as alyx stated, was primarily used for heavy lifting. At its core is a substance that appears to be a xen crystal. The good news is that this coffee mug is not as heavy as the gun that alyx struggles to lift and you don''t need an hev suit to wear it.<br>\nSo drink from this mug and pay your tribute to half-life, one of the best games ever made and to that one free man - gordon freeman.<br>\nOh and keep praying for half-life 3.<br><br>\nLet us know what you think in the comments below, which are the most epic weapons in your opinion.\n<br><br>This half life gaming coffee mug is digitally printed using alien technology.', 'images/product/45/gravity_gun_left.png', 349, 0, '2017-04-23 06:21:04', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychogravitygunmug', 0, 'Gaming'),
(46, 'mugs', 20, 'Counter Strike', 'Loser Buy A Defuser', 'loser defuser counter strike gaming coffee mugs india', 'Dedicated to all those losers who never buy defusers. Always remember to drink your coffee from this mug before a counter strike tournament as a reminder for you know who.', 'Based on real fictional events<br><br>\nIt was the dawn of the century where an epic battle that has been going for ages was about to come to an end. The balance of the force was about to be shifted to either of the side and it all rested on the capture of a very important and dusty camp site. Millions layed down their lives in their pursuit to capture that camp site. both sides suffered extreme losses, almost all of their global elites were nearing their ends. Just a handful of extremely elite ones remained along with some campers as well who were able to survive this long thanks to their noob camping skills. But there is indeed a thin line that even a noob camping guy should not cross and that is, trying to defuse a bomb without a defusal kit that too in the presence of global elites. Moreover if this particular bomb went off, it would have been an extremely heavy blow to their side.<br>\nThe guy defusing the bomb was reciting the prayer under his breath "In the name of the super saiyan god goku, the holy sons gohan and goten and the eternal dragon shenron'', please make this bomb defuse faster. Right then and there in the heat of the battle, a global elite made the right decision and gave a head shot to that guy, his own guy because he knew very well the consequences of the failure. he got to the bomb and defused it in a jiffy using the defusal kit and vowed to always have this coffee mug handy that would remind everyone not to act like that loser and to buy a defuser.<br><br>\nFast forward 30 years, peace has been restored to the valley and in rememberance of that fateful day, we are giving an opportunity to each and every one of you to get this mug and remind the whole world around you to always and always buy a defuser.<br><br>\nLet us know your bomb defusal moments in the comments below. <br><br>\n\nThis counter strike gaming coffee mug is digitally printed using alien technology.', 'images/product/46/defuser_right.png', 349, 0, '2017-04-23 06:26:18', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychodefusermug', 0, 'Gaming'),
(47, 'mugs', 15, 'Mario', 'One Up Mug', 'mario one up gaming coffee mugs india', 'On the purchase of this mario one-up coffee mug, you get an additional you!', 'After years of extensive research, our scientists at psycho labs have finally cracked the formula that gave mario an extra life, equipped with this vital information our scientists have created this 1-up coffee mug that will give you an extra life. So whatever the situation is, you can definitely count on this mug to give you 1-up. believe us this is psycho labs certified. <br><br>\n\nNote (our lawyers forced us to add this) : This description is supposed to be taken as a joke, don''t start banging your head against walls or start jumping down the clifs.\n<br><br>\nLet us know your views in the comments below. <br><br>\n\nThis mario one up gaming coffee mug is digitally printed using alien technology.', 'images/product/47/mario_left.png', 349, 0, '2017-04-23 06:35:05', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychooneupmug', 1, 'Gaming'),
(48, 'mugs', 14, 'One Punch Man', 'OK.', 'saitama one punch man ok anime coffee mugs india', 'We can''t give you saitama''s powers, but his attitude is the closest thing that you can get by drinking from this one punch man coffee mug.', 'We tried a lot to make a coffee mug that would grant you saitama''s powers, but unfortunately our scientists couldn''t crack the code for that, but it''s not like that we have given up on it, believe us our scientists are still working on it. Meantime we came up with this innovative mug to give you a taste of saitama''s attitude towards life and especially problems. So however grave and dismal the situation be all you need to do is take a sip from this mug and say ok. Believe us its gonna be all right.<br><br>\nLet us know your views of your ok moments in the comments below. <br><br>\n\nThis one punch man anime coffee mug is digitally printed using alien technology.', 'images/product/48/ok_left.png', 349, 0, '2017-04-23 06:47:16', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychookmug', 1, 'Gaming'),
(49, 'mugs', 27, 'Nothing', 'Otaku At Heart', 'otaku at heart anime coffee mugs india', 'Grab this otaku coffee mug and show the whole world where your heart really is. A true otaku just cannot miss this design.', 'It''s tough, it''s really tough to explain the world what we truly are, deep down in our hearts what we truly desire. This coffee mug is just one way to let the whole world know what you crave for. We made this design for all those true otaku heads that need to show their love for this amazing culture by drinking from this mug.<br><br>\nAlthough we are aware that for most, you will just end up explaining what this word actually means and if this even is an actual word or not, but hey whatever helps in spreading this culture.<br>\nFor those interested here''s a link for clarification <a target="_blank" href="https://en.wikipedia.org/wiki/Otaku">Otaku? what''s that?</a><br><br>\nLet us know your views in the comments below.<br><br>\nThis otaku anime coffee mug is digitally printed using alien technology.', 'images/product/49/otaku_left.png', 349, 0, '2017-04-23 06:50:25', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychootakumug', 0, 'Anime'),
(50, 'mugs', 3, 'Portal', 'Infinite Loop', 'inifnite loop portal gaming coffee mugs india', 'Wear this portal gaming t shirt before you go out for your routine tests. Cake and grief counselling will be available at the conclusion of the test - GLaDOS', 'Chell : "you know it will be real fun to create two portals one over another, it will just act like an infinite loop".<br>\nGLaDOS : "Well not for me, you see, your entire life has been a mathematical error... a mathematical error I''m about to correct!"<br>\nChell : "All you earthlings safe from the clutches of aperture science, grab this coffee mug and show your support for me as i fight my way through test chambers in search of the cake and to destroy GLaDOS(Genetic lifeform and disk operating system)."<br>\nGLaDOS : "In the end, you will be baked and there will be a cake."\n<br><br>\nPsycho Store : "This was the last message that we intercepted from aperture science, chell has asked us to create this coffee mug so that you all can drink your morning coffee from it and show her your support. Now don''t disappoint her. Get it and take to the streets to oppose the atrocities of aperture science and GLaDOS."\n<br><br>\nLet us know your favorite GLaDOS quotes and moments from portal series in the comments below.\n<br><br>\nThis portal gaming coffee mug is screen printed on a 100% cotton white colored psycho store tshirt.', 'images/product/50/portal_left.png', 349, 0, '2017-04-23 07:11:43', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychoportalmug', 0, 'Gaming'),
(51, 'mugs', 6, 'Contra', 'S Power', 's power contra gaming coffee mugs india', 'Best power up in the history of video games. Period.', 'If you can recognize this print, we have nothing but utmost respect for you. This thing right here is the reason for some of the most memorable memories of our childhood. Recall that invincible  feeling that we felt on getting this S power, the feeling that there''s no stopping us now. Lets get that adrenaline rush, that invincible feeling once again. Drink your coffee from this s power mug in real life and pay your homage to one of the best game out there and once again, be invincible.<br><br> For those who missed out on this, well here''s your chance to pay some respect to where it all began, <a target="_blank" href="https://en.wikipedia.org/wiki/Contra_(video_game_series)">Contra.</a><br><br>P.S :  Those who thought this is some pixelated superman stuff, just letting you know our assassin minions are on their way.<br>\nLet us know in the comments below what you think about this power or any other power that you think is comparable to this.\n<br><br>\nThis contra s power gaming coffee mug is digitally printed using alien technology.', 'images/product/51/spower_right.png', 349, 0, '2017-04-23 07:14:59', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychospowermug', 0, 'Gaming'),
(52, 'mugs', 26, 'Pokemon', 'Bulbaaa', 'vintage cartton bulbaa anime coffee mugs india', 'Somethings achieve evergreen status, for others here''s this coffee mug to sip their green tea from.', 'The same time when I realized that I need a water character power (read the product description of water splash tee if you still haven''t http://bit.ly/2layNL2 ), I thought hey why not get some greenry also, so that I can also rest in natural shade whenever I want to. I mean if i am gonna get some water then better to get both at once and not to keep on pestering one of the greatest trainer again and again.<br><br>\nSo here we are to satisfy all your green needs (pun intended)<br>\nYes, I did get my scientists to inject organic greenry for our pot lover friends in this design. yes I can hear you screaming with joy over the analytics screen<br>\nYou can always thank me later after you get the mug.<br><br>\nNote : Don''t believe everything you read on the internet.<br><br>\nLet us know in the comments below which other designs you want to keep in your closet.<br><br>\nThis anime coffee mug is digitally printed using alien technology.<br><br>\nThis is a fan art/parody design and is not official merchandise.', 'images/product/52/bulba_left.png', 349, 0, '2017-04-23 07:21:16', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychobulbaaamug', 1, 'Gaming'),
(53, 'mugs', 25, 'Pokemon', 'Water Splash', 'vintage cartton water splash anime coffee mugs india', 'Every time you don''t feel like taking a bath or if you are in dire need of water, you can always count on this water spewing coffee mug fulfilling all your water requirements.', 'This happened when I was travelling through The Great Indian Thar desert on my newly bought royal enfield. But I couldn''t be more wrong about the harsh difficulties one faces in the desert and as everyone can guess I was in dire need of water, but i only had fire and electric based designs with me which obviously were useless for me at that moment.<br><br>\nIt was then and there that i decided that I need to keep a water spewing coffee mug also with me if i need to continue my travelling escapades.<br>I notified my research team to again track down the greatest trainer and since we were on good terms from our last meeting he easily gave us access to whatever we required from which our scientists extracted some tissues and infused them into this awesome mug.<br><br>\nNote: no one was hurt in the making of this coffee mug.<br><br>\nLet us know in the comments below which other designs you want to keep.<br><br>\nThis anime coffee mug is digitally printed using alien technology.<br><br>\nThis is a fan art/parody design and is not official merchandise.', 'images/product/53/squirtle_right.png', 349, 0, '2017-04-23 07:26:31', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychowatersplashmug', 0, 'Anime'),
(54, 'mugs', 21, 'Pokemon', 'Playing With Fire', 'playing with fire anime coffee mugs india', 'We shall not be held responsible if after drinking form this coffee mug you somehow evolve into a fire breathing person and become a lazy bum.', 'So it had been quite some time since we did any catching and we decided it was time to again go hunting. Turns out the luck was on our side and we managed to capture this beauty, yes you figured it out right. After capturing this cute little fiery beast our scientists tried to mimic it''s tail, where in the flame on it''s tail indicates your emotions. We thought we might be able to do something similar, but alas our scientists were not capable enough.\n<br><br>\nSo we thought chuck it, we will just capture the happy emotions from this cute little creature and infuse it into the coffee mugand that is exactly what we did. So we assure you that after drinking fom this fiery mug, happiness is the only emotion you will feel.\n<br><br>\nThis anime coffee mug is digitally printed using alien technology.<br><br>\nThis is a fan art/pardoy design and is not official merchandise.', 'images/product/54/charmander_left.png', 349, 0, '2017-04-23 07:30:21', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychocharmandermug', 0, 'Anime'),
(55, 'mugs', 31, 'Pokemon', 'Catch Em All', 'catch em all pokeball pokemon anime coffee mugs india', 'We know you want to, but please resist the urge to throw this to catch your favorite pokemon. This is for drinking coffee people, be realistic.', 'One of the most iconic designs has now been printed on a coffee mug for you to drink from it. Please note again "to drink from it", you are not supposed to throw it, it won''t catch anything. <br>\nBelieve us when we say this with such confidence as we have tried numerous times ourselves but always ended getting up broken mugs.<br><br>\nThis pokemon anime coffee mug is digitally printed using alien technology.<br><br>', 'images/product/55/pokeball_right.png', 349, 0, '2017-04-23 11:05:47', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychopokeball', 1, 'Anime'),
(56, 'posters', 6, 'Contra', 'S Power', 'contra s power gaming posters india', 'Best power up in the history of video games. Period.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis S Power contra gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.', 'images/product/56/spower.png', 249, 0, '2017-04-28 11:55:08', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(57, 'posters', 12, 'Fallout', 'Nuka Cola', 'nuka cola fallout gaming posters india', 'The most popular drink of the wasteland, now printed on a poster for you to showcase and show your support for the post apocalyptic world and the vault boy. Never forget the vault boy.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis nuka cola fallout gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.', 'images/product/57/nuka_cola.png', 249, 0, '2017-04-28 11:59:48', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
