(80, 'posters', 34, 'Nier Automata', '2B', '2b nier automata gaming posters india', '2b or not to be.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis 2B nier automata gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>', 'images/product/80/2b.png', 249, 0, '2017-04-28 13:47:38', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Gaming'),
(81, 'tshirt', 35, 'Dragon Ball Z', 'Goku Super Saiyan Blue', 'goku super saiyan blue dragon ball z anime t shirts india', 'You don''t need 5 super saiyans anymore to transform yourself into a super saiyan god. Just put on this dragon ball z goku super saiyan blue t shirt and experience the power of the god anytime, anyplace. For times when 9000 power level isn''t just enough.', 'So it had been quite some time and my power level was lingering somewhere around 9000 or more. I thought maybe saitama''s workout routing might help but seriously I wasn''t seeing much improvement (I didn''t go bald though so I don''t know if that is a necessary condition for the workout to be effective or not).<br><br>\nI had complete faith in my psycho labs scientists, so i set to work to contact goku himself. To be honest we used our 2 months food supply in order to keep goku fed for just 2 days. Chi Chi have my symapthies.<br> So finally our scientists set to work to infuse goku''s genes and tissues and whatnot into our very own cloth material to make sure that who ever wears this dragon ball z t shirt is bound to go super saiyan blue.<br><br>\nGoing super saiyan blue had never been easier.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your super saiyan moments in the comments below.<br><br>\nThis dragon ball z goku super saiyan blue anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/81/goku_blue.png', 599, 111, '2017-05-04 13:19:27', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychossblue', 1, 'Anime'),
(82, 'mugs', 35, 'Dragon Ball Z', 'Goku Super Saiyan Blue', 'goku super saiyan blue dragon ball z anime coffee mugs india', 'For times when your coffee''s 9000 level isn''t just enough. Get your super saiyan blue coffee.', 'So it had been quite some time and my power level was lingering somewhere around 9000 or more. I thought maybe saitama''s workout routing might help but seriously I wasn''t seeing much improvement (I didn''t go bald though so I don''t know if that is a necessary condition for the workout to be effective or not).<br><br>\nI had complete faith in my psycho labs scientists, so i set to work to contact goku himself. To be honest we used our 2 months food supply in order to keep goku fed for just 2 days. Chi Chi have my symapthies.<br> So finally our scientists set to work to infuse goku''s genes and tissues and whatnot into our very own coffee mugs to make sure that who ever drinks from this dragon ball z mug is bound to go super saiyan blue.<br><br>\nGoing super saiyan blue had never been easier.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your super saiyan moments in the comments below.<br><br>\nThis dragon ball z goku super saiyna blue anime coffee mug is digitally printed using alien technology.', 'images/product/82/goku_right.png', 349, 0, '2017-05-04 19:40:59', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(83, 'posters', 35, 'Dragon Ball Z', 'Goku Super Saiyan Blue', 'goku super saiyan blue dragon ball z anime posters india', 'Place this dragon ball z goku super saiyan blue poster on your wall for times when 9000 power level is just not enough.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis Goku super saiyan blue anime poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>', 'images/product/83/goku_blue.png', 249, 0, '2017-05-04 19:54:17', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Anime');
INSERT INTO `products` (`product_id`, `product_type`, `design_id`, `product_game`, `product_name`, `product_url`, `product_intro`, `product_desc`, `product_image_path`, `product_price`, `product_qty_sold`, `product_date`, `add_to_cart_comment`, `product_state`, `hashtag`, `featured`, `category`) VALUES
(84, 'tshirt', 32, 'Attack On Titan', 'Dawn Of The Titans', 'dawn of the attack on titan anime t shirt india', 'Grab this attack on titan inspired anime t shirt and let the whole world know about the grave and desperate times humanity is in.', 'Even though recon corps are losing their lives while fighting with different types of titans, but not all of the humanity is aware of the grave times we are in.<br>\nWe made this tee specially for you to wear and make the whole world aware that the titans are coming. It is time to fight, for the survival of the humanity.<br><br>\nWe will all perish if we don''t stand together against the titans.<br><br>\nLet us know your views in the comments below..<br><br>\nThis attack on titan inspired anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/84/dawn.png', 599, 2, '2017-05-08 20:42:29', 'Psycho Store : Wear this to show your support for the humanity', 'live', 'psychodawnoftitans', 0, 'Anime'),
(85, 'tshirt', 33, 'Halo', 'Master Chief', 'master chief halo gaming t shirt india', 'We know how much we all want a companion like cortana, but sadly we don''t have master chief''s helmet to insert cortana''s chip into (we have the chip, believe us). So this halo inspired tee is the closest we can get to wearing master chief''s helmet.', 'I still remember the time when master chief first came into view and that helmet was the first thing that made a strong impression in my mind. Ever since then I have been wanting to own a similar head gear into which i can just insert cortana''s chip and voila! a priceless companion will be with me. <br><br>\nBut nope, the world does not work like that. we still have ignorant people on this planet who would serve you pepsi when asked for coke. How can you expect a working master chief helmet in this world then?<br><br>\nBut not everything is lost, we made this halo inspired minimalist design of master chief''s helmet to give us company until people can differentiate between pesi and coke and start working on things that matter.<br><br>\nLet us know your favorite master chief moments in the coments below.<br><br>\nThis halo gaming t shirt is digitally printed on a 100% cotton green colored psycho store t shirt.', 'images/product/85/halo.png', 599, 9, '2017-05-21 20:45:04', 'Psycho Store : Please don''t expect that cortana will start talking to you from this helmet.', 'live', 'psychomasterchief', 0, 'Gaming'),
(86, 'tshirt', 36, 'Dragon Ball Z', 'God Mode Saiyan Prince', 'vegeta super saiyan blue dragon ball z anime t shirt india', 'Pride and honor are two major traits that define this saiyan prince. So wear this vegeta inspired dragon ball z t shirt and get that saiyan pride and honor infused in yourself. By the way that super saiyan blue power level is just an added advantage.', 'I had already reached the super saiyan blue power level with the previous <a href="http://psychostore.in/product/81/goku-super-saiyan-blue-dragon-ball-z-anime-t-shirts-india"> goku tee</a>.<br>\nBut still there was something missing, something that I just could not pin point on and then i had en epiphany, i realized that whatever level goku has reached is partly because of vegeta, his fierce competitor that drove him to power up and also because of the traits (pride and honor) that vegeta values so much.<br><br>\nPride and honor is what i am missing on and wish to gain. So here we are with a new vegeta inspired design that would help you gain those traits and master your new super saiyan blue power level.<br><br>\nGoing super saiyan blue had never been easier.<br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your super saiyan moments in the comments below.<br><br>\nThis dragon ball z vegeta super saiyan blue anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/86/vegeta_ssb.png', 599, 42, '2017-05-26 13:14:45', 'Psycho Store : Value your saiyan pride and honor.', 'live', 'psychovegetassb', 1, 'Anime'),
(87, 'tshirt', 37, 'Nier Automata', 'Whats The Report', 'pod report 2b nier gaming t shirts india', 'Show some love to your pod042 who helped you so much in your battles against machine life forms by wearing this design inspired by your favorite bot 2B from nier automata.', 'It was just another day for us, we were busy with intercepting random frequencies to eavesdrop on people''s conversations, but somehow we hit the jackpot, we actually heard pod 042 reporting to YoRHa about everyone''s favorite bot 2B.<br><br>\nYoRHa: "What''s the report"?<br>\nPod 042 : "Report : satisfied, but mmm there is something I would like to complain about."<br>\nYoRHa : "Is it about 2B"?<br>\nPod 042 : "Yes, exactly, I know 2B is busy fighting and everything but still even when she is standing idle she doesn''t pat me much. Patting me makes my electrons move a bit faster and I get a very strange but exciting feeling which I have started to miss these days".<br>\nYoRHa : "Don''t worry, we will see that the point gets across to 2B".<br><br>\nSo Pod 042 needs some love from 2B. We knew exactly what we had to do and here it is, we made this design for all you moon dwellers. So wear this t shirt to show your support for the cause that 2B should pat pod 042 more.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your favorite moments between 2B and pod 042.<br><br>\nThis nier automata 2B gaming t shirt is digitally printed on a 100% cotton grey colored psycho store t shirt.', 'images/product/87/nier.png', 599, 9, '2017-06-06 20:22:41', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(88, 'tshirt', 38, 'Nothing', 'Infected Specimen', 'biohazard infected specimen gaming t shirts india', 'Please contact your nearest quarantine authorities immediately when you spot an infected specimen. Also make him/her wear this biohazard t-shirt so that everyone can easily identify who the infected specimens are.', 'I had been saying this for years, but nope, no one listens to me. Global warming, dying species, failing economy, etc etc used to be the talk of the time when we were supposed to be discussing about effing zombie apocalypse. Well no point talking about it since it''s already here now.<br><br>\nAnyway, now is the time to listen to me and listen very closely my fellow earthlings. After extensive research in our psycho labs, our scientists have uncovered a very special and hidden weakness of these zombies. The special feature of this particular design is that infected people''s mind somehow thinks that another person wearing this design is also infected.<br><br>\nSo we did what we do best, we printed this life saving design on our t-shirts for all you earthlings to wear and save yourself from these zombies because once you wear this tee, all the zombies will think that you are also one of them and won''t attack you.<br><br>\nAlso, needless to say we have sent our very capable and skilled minions as spies into zombie''s territories to find out more about them.<br>\nWe will keep you updated on the progress.<br><br>\nLet us know your zombie moments in the comments below.<br><br>\nThis zombies gaming t shirt is digitally printed on a 100% cotton white colored psycho store t shirt.', 'images/product/88/biohazard_white.png', 599, 16, '2017-06-15 20:40:15', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(89, 'posters', 38, 'Nothing', 'Infected Specimen', 'biohazard infected specimen gaming posters india', 'Place this poster or gift this poster to an infected specimen that you know.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis Biohazard infected specimen gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>', 'images/product/89/biohazard.png', 249, 0, '2017-06-17 09:06:23', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(90, 'posters', 9, 'Assassins Creed', 'Rest in Peace', 'rest in peace assassins creed gaming posters india', 'Place this poster n your wall to show your support for ezios'' fight for justice and revenge.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis Assassin''s Creed requiescat in pace gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>', 'images/product/90/rip.png', 249, 0, '2017-06-17 09:09:33', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
