(93, 'tshirt', 39, 'Dark Souls', 'The Abysswalker', 'artorias the abysswalker dark souls gaming t shirts india', 'If you stare long into the abyss, the abyss stares back. Get this dark souls inspired t shirt sporting one of the commanding knights of lord gwyn''s army, artorias the abysswalker along with his loyal battle companion the great grey wolf sif.', 'Rumors are that after sir artorias the abysswalker was consumed by the darkness of the abyss, a particular design was found in his belongings which people presumed he thought of engraving it on his shield or maybe armour. Even after ages, that design is quite a legend and a lot of people still keep that design in their possession out of  respect for the legendary knight<br><br>\nAs soon as we got to know about it, we sent our bravest minions to gather information about that design from New londos or oolacile. We trusted our minions and yes did not disappoint us, they came back with information which we used to create this spectacular design.<br><br>\nSo show your respect for the legendary knight by wearing this dark souls t shirt. Also, don''t expect you will get the abysswalking ability after wearing it.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your darkest abyss moments in the comments below.<br><br>\nThis darks souls artorias the abysswalker gaming t shirt is digitally printed on a 100% cotton brown  colored psycho store t shirt.', 'images/product/93/artorias.png', 599, 27, '2017-06-23 20:40:00', 'Psycho Store : Do you have what it needs to walk the abyss?', 'live', 'psychotheabysswalker', 1, 'Gaming'),
