(95, 'tshirt', 40, 'Overwatch', 'Cheers Love Cavalrys here', 'cheers love cavalrys here tracer overwatch gaming t shirts india', 'Cheers love! The tracer inspired overwatch t shirt is here.', 'After the tragic accident of the teleporting fighter plane, splitstream, everyone had lost hope for lena oxton aka tracer. Luckily she resurfaced few months back but that accident had already taken it''s toll. It was difficult for her just to maintain her physical form in the present, she practically became a living ghost. We have winston to thanks for bringing stability to tracer and giving her the powers to zip through time.<br>\nBut little did we know that winston is still working on ways to even enhance tracer''s abilities and empower her even more.<br><br>\nWe have reasonable reasons to believe that this design will be used to further enhance her powers and being the good guys we are, we decided to launch this design on our tees for all our fans and tracer''s fans to wear and enhance their powers as well.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your favorite overwatch character in the comments below<br><br>\nThis overwatch tracer gaming t shirt is printed using direct to garment printing on a 100% cotton white colored psycho store t shirt.', 'images/product/95/tracer_white.png', 599, 20, '2017-07-09 08:50:46', 'Psycho Store : Cheers Love! The cavalrys here.', 'live', 'psychocheerslove', 1, 'Gaming'),
