(101, 'tshirt', 41, 'Dragon Ball Z', 'Goku Saiyan Evolution', 'goku saiyan evolution dragon ball z anime t shirts india', 'Whatever your saiyan evolution level may be, just wear this dragon ball inspired goku evolution t shirt and it will help you reach your max power level.', 'While we reached our supper saiyan blue level and were wearing our <a href="http://psychostore.in/product/81/goku-super-saiyan-blue-dragon-ball-z-anime-t-shirts-india">Super Saiyan Blue </a> t shirt, we did come across a lot of people who were still training and were below our power level and they wanted a t shirt to suit their power level.<br>\nThey did not want to wear the blue saiyan tee while being just in the super saiyan form as a respect to higher power level people.<br><br>\nWe realized that not all people are at the same level, so we bring to you our latest saiyan evolution design. now it does not matter which stage of evolution you are at, you are bound to be somewhere between these three.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your saiyan evolution stage in the comments below.<br><br>\nThis goku saiyan evolution dragon ball z inspired anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/101/evolution.png', 599, 126, '2017-07-18 13:44:38', 'Psycho Store : Which evolution level do you belong to?', 'live', 'psychogokuevolution', 1, 'Anime'),
