(106, 'mugs', 36, 'Dragon Ball Z', 'God Mode Saiyan Prince', 'vegeta super saiyan blue dragon ball z anime coffee mugs india', 'Where is your pride and honor? Get this dragon ball z inspired vegeta coffee mug to get your pride and honor back.', '11 oz (330 ml) 100% Ceramic mugs with high glossy finish.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your favorite saiyan prince moments in the comments below.<br><br>\nThis vegeta super saiyan blue dragon ball super anime mug is digitally printed using alien technology.', 'images/product/106/vegeta_left.png', 349, 0, '2017-07-18 23:24:47', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Anime'),
(107, 'tshirt', 45, 'Naruto', 'Uchiha Crest', 'uchiha crest naruto anime t shirts india', 'Wear this uchiha crest t shirt to awaken your sleeping sharingan.', 'I realized the importance of this symbol when I went trekking last week. Although I had my <a href="http://psychostore.in/product/23/kamui-mangekyo-sharingan-naruto-anime-t-shirt-india">Kamui</a> tee with me which allowed me to see a lot of hidden things. <br><br>\nBut do you have any idea how difficult it is to light up a fire? That is the time when I decided the first thing I need to do after returning to civilisation is to launch an uchiha inspired t shirt so that everyone can have this ability to create a fire whenever required. Well technically not everyone but only those who are willing to train and harness their energy.<br><br>\nSo get your hands on this uchiha crest t-shirt and join the family of fire breathers.<br><br>\nLet us know your sharingan awakening moments in the comments below.<br><br>\nThis uchiha crest naruto inspired anime t shirt is digitally printed on a 100% cotton navy blue colored psycho store t shirt.', 'images/product/107/uchiha.png', 499, 58, '2017-08-07 16:07:51', 'Psycho Store : Wear this on a first date, you will rock.', 'live', 'psychouchihacrest', 1, 'Anime'),
(108, 'tshirt', 43, 'Rick And Morty', 'Pickle Rick', 'call me pickle rick and morty cartoon t shirts india', 'Get your own version of pickle rick now with this rick and morty inspired t shirt.', 'We know that not everyone is capable enough to convert themselves into a pickle through science or any other way as well. So after doing all the dirty work for you, here we are with our all new rick and morty t shirt featuring the very famous pickle rick.<br><br>\nNow the interesting thing is that the pickle rick is not just for showing off, but this tee has the power to convert you into a pickle < insert your name here >.<br>\nIf you are thinking exactly how it will work, then we have a surprise for you, we won''t be telling you the exact procedure as we want all of you to put your thinking caps on and figure out the mystery for yourselves.<br><br>\nNote : (Our lawyers forced us to add it here) we shall not be held responsible if a cat comes and considers you a snake and eats you up.\n<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your pickle moments in the comments below.<br><br>\nThis rick and morty cartoon t shirt is digitally printed on a 100% royal blue colored psycho store t shirt.', 'images/product/108/pickle.png', 599, 24, '2017-09-15 09:51:32', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Cartoon'),
(109, 'tshirt', 44, 'Rick And Morty', 'What You Looking At', 'rick and morty cartoon t shirts india', 'This Rick and morty t shirt gives you the answer to all the queer looks you get in life.', 'You know the looks you get when you are the odd one out, when you don''t fit in with the expectations of the normality.<br>\nI am sure almost everyone has felt that way at least once in their life, if not then really you need to, only then you will understand the feeling behind this amazing rick and morty design.<br><br>\nBut the important thing is that now you can let this tee answer all those looks for you.So you can focus on doing things you are best at and that is being queer.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your experiences in the comments below.<br><br>\nThis Rick and morty cartoon t shirt is digitally printed on a 100% cotton turquoise colored psycho store t shirt.', 'images/product/109/rickandmorty.png', 599, 20, '2017-09-22 10:25:09', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Cartoon'),
(110, 'tshirt', 0, 'Dragon Ball Z', 'Goku Kame Black', 'dragon ball z goku kame black anime t shirt india', 'Continue your training at 100G now in this new dragon ball z inspired black goku kame t shirt.', 'Although we agree that nothing can beat the feeling of dressing up like goku, but well we realized that we are not actually inside an anime and we do need some variety with our clothes.<br> but yes it''s too tough to do your training in any dress that does not have a kame or kang kai''s symbol on it.<br><br>\nSo here it  is guys, for all you dragon ball z enthusiasts, get this goku kame black symbol tee.<br><br>\nLet us know your views in the comments below<br><br>\nThis goku black kame dragon ball z inspired anime t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/110/goku_black.png', 599, 85, '2017-09-22 14:49:24', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychokameblack', 1, 'Anime'),
(111, 'tshirt', 42, 'The Witcher 3', 'Witcher Wolf Medallion', 'witcher 3 wolf medallion swords gaming t shirts india', 'Show the whole world which school you belong to by getting this wolf medallion gaming t shirt inspired by one of the best games of this generation The Witcher 3.', 'Ever since our first interview with geralt, we have been wanting to tell him how we were able to infuse the magical substances that he gave us into our tee. We had sent him a raven long back and we were really thrilled when we got a response from him stating that he would love to come and see it for himself.<br><br>\nYou can imagine our excitement level was over 9000 at that time and our whole team was in full preparation to welcome him.<br>\nFinally the day came, everything was going super fine until he saw our previous <a href="http://psychostore.in/product/16/witcher-3-white-wolf-gaming-t-shirts-india">design </a>and was like "Guys where are my swords? Why aren''t they in the design?"<br><br>\nAll of us were stunned, why didn''t any of us think of it before, how can we even miss it. So as promised to geralt here we are with our new and improved medallion design along with geralt''s swords as well.<br><br>\n Design By : <a target="_blank" href="https://jit-art.deviantart.com/">Arijit Sarkar</a><br><br>\nLet us know your monster hunting experiences in the comments below. <br><br>\nThis witcher 3 wolf wolf medallion gaming t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/111/wolf_medallion.png', 599, 7, '2017-10-30 20:12:25', 'Psycho Store : Use this on a first date, you will rock.', 'hidden', 'psychofamous', 0, 'Gaming'),
