(115, 'tshirt', 46, 'Star Wars', 'Star Wars The Last Jedi', 'star wars t shirts india', 'The force is strong with this star wars last jedi inspired t shirt. Wear it and get the force on your side.', 'We all know how rey is rumored to be the last jedi. But all of us here at psycho store literally hate this fact. What if a zombie apocalypse happens in the near future and there are no jedis to save us? I personally believe that a light saber is a perfect weapon for a zombie apocalypse. Light weight handy, portable and is something which isn''t dependent on an external thing like a gun.<br><br>\nImagine running out of ammo right in the middle of a zombie invasion, that can never happen with a light saber, right?<br><br>\nhence proved that this world needs more jedis (and more light sabers) to prevent future zombie apocalypse among other things as well.<br>\nSo your friendly neighborhood geeks have developed this star wars tee which will help accelerate your growth towards becoming a jedi.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your jedi moments in the comments below.<br><br>\nThis last jedi star wars inspired movie t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/115/lastjedi.png', 599, 8, '2017-11-02 20:57:58', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychothelastjedi', 1, 'Movies'),
(116, 'tshirt', 47, 'Dragon Ball Z', 'Goku Ultra Instinct', 'goku ultra instinct dragon ball super anime t shirts india', 'Achieve that unbeatable ultra instinct state with this insane dragon ball super inspired goku ultra instinct t shirt.', 'Ever since those insanely famous 109 and 110 episodes were aired in Dragon Ball Super the whole world was in a frenzy to know more about that new state which even our lord beerus has not been able to master yet.<br><br>\nYes, you guessed it right we are talking about everyone''s favorite Ultra Insinct state. Although we are still confused if it is a new state or a new transformation. Personally we believe it''s a state of being rather than another transformation.<br><br>\nJust imagine being in that state while transformed into super saiyan blue and with Kaio-Ken as a cherry on the top.<br>\nSo get yourself this new goku ultra instinct tee before goku starts fighting jiren again. You just have to wear this tee as respect and support to goku while watching goku fight jiren in order to save our universe.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your favorite ultra instinct moments in the comments below.<br><br>\nThis dragon ball super inspired goku ultra instinct anime t shirt is digitally printed on a 100% black colored psycho store t shirt.', 'images/product/116/goku_ui.png', 599, 144, '2017-11-21 14:44:35', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychoultrainstinct', 1, 'Anime'),
