(121, 'tshirt', 48, 'Rick And Morty', 'Evil Morty', 'supreme evil rick and morty cartoon t shirt india', 'It is time for celebration as our supreme leader has launched this new rick and morty inspired design for all his loving citizens.', 'It was just another morning in the citadel of ricks when suddenly this thing was all over the news that our supreme leader has organised a speech for a very importance announcement in the afternoon right in the middle of the city.\nAs the good citizens we are , everyone made sure that they could attend it.<br><br>\nSupreme Leader : "This seems like a good time for a drink, and a cold calculated speech with sinister overtones. A speech about politics, about order, brotherhood, power. But speeches are for campaigning. Now is the time for action. SO get into action by getting yourself this evil morty tee shirt."<br><br>\nThat was the time when this new design was first made public to the world, every one was blown away, including us<br>\nSo we made sure that we make this design available to you all because my friends it is the time for action.<br><br>\nDesign By : Joel Monteiro<br><br>\nLet us know your favorite rick and morty moments in the comments below.<br><br>\nThis rick and morty inspired evil morty cartoon t shirt is digitally printed on a 100% cotton white colored psycho store t shirt.', 'images/product/121/evil_morty.png', 599, 8, '2017-11-24 19:29:16', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Cartoon'),
(122, 'tshirt', 51, 'Grand Theft Auto', 'Trevor The Psychopath', 'trevor the psychopath gta v gaming t shirts india', 'Do you have that madness in you to match that of trevor''s? With this gta v inspired trevor tee you can definitely achieve it.', 'So me and my friend was at this really good cafe whose food both of us religiously loved. My friend was lost in some kind of life contemplation zone for past few minutes now and I was waiting for him to snap out of it. Suddenly he comes out of the zone and says "i have figured it out" and calls the waiter,<br>\nThe waiter  wasn''t a regular seemed like a new hire, anyway and my friend just ordered a coke after all the "I have figured it out" excitement. I was a bit confused and looked at him with that "waiting for an explanation" expressions. He looks at me and goes like\n"I was trying to figure out which soft drink will taste best with this out of the world burger"<br><br>\nRight, talk about priorities.<br><br>\nhe got his glass of soft drink, takes a sip with so much excitement and just starts cursing loudly and I was like "calm down man. What happened?"<br>\nHe calls the waiter back<br>\nFriend : "What kind of joke is this?"<br>\nwaiter clearly a bit confused, but surely irritated,<br>\nWaiter : "what, I don''t understand?"<br>\nF: "i clearly remember ordering coke and you bring me a glass of pepsi, do you even understand the basics of how this world works."<br>\nNow waiter clearly losing his temper<br>\nW: "Don''t eat my head man, they are basically the same thing."<br>\nNow I don''t know which world this waiter was from but in my world this will lead to chaos and anarchy of a totally different scale.\nSo after a few broken glasses and plates, calling friends for backup, chasing a car on our bike and some bone shattering punches here and there, we finally managed to call it a day and head home.<br><br>\nAll the while I was reminded of this guy who deserves a design from us. Still don''t know what took us so long to bring this out.<br>\nAnyway now that it''s here feed your madness with this amazing ode to the guys who defines what true madness is, Tevor Phillips.<br><br>\nDesign By : Ajax Kumawat<br><br>\nLet us know your favorite moments of madness in comments below.<br>\nThis gta v inspired trevor gaming t-shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/122/1.png', 599, 1, '2017-11-28 17:47:40', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(123, 'tshirt', 49, 'Death note', 'This Is My Cake', 'l the justice cake death note anime t shirts india', 'Get this death note inspired tee and let L do the talking with all the people who keep staring at your cake. keep your cakes safe and sound.', 'We were honestly very tired with these special species of humans who keep on demanding one bite of your cake every time you seem to be enjoying one.<br>\nThis was very much in everyone''s knowledge that an imminent solution is required to contain these kind of people.<br><br>\nSo our scientists went to work and one day in her dreams came L and gave her the secret to howhe used to make sure that no one can ever touch his cake.<br>\nSO with this new equipped knowledge we went to work and we are really proud to announce that  we have created a nice little chibi solution to this problem.<br><br>\nTried and tested with 99% accuracy on humans.<br><br>\nP.S : we tried this on our dog, nope doesn''t work.<br><br>\nDesign By <a href="https://www.facebook.com/cerinius/" target="_blank"> Anwesha Pradhan.</a><br><br>\nLet us know your favorite L moments in the comments below.<br><br>\nThis L inspired death note anime t shirt is digitally printed on a 100% golden yellow colored psycho store t shirt.', 'images/product/123/mockup.png', 599, 10, '2017-12-24 20:01:01', 'Psycho Store : Use this on a first date, will protect your cake.', 'live', 'psychofamous', 1, 'Anime'),
(124, 'tshirt', 52, 'Assassins Creed', 'Choose Your Assassin', 'assassins creed gaming t shirts india', 'No matter which assassin you relate to, get yourself this assassins creed t shirt to show your allegiance for the creed and respect for the brotherhood.', 'I don''t remember what crossed my mind, i blame it on the jasper kyd''s music playing in the background though, i just blurted out "Assassins creed II is the best one out there and ezio is hands down the best assassin".<br><br>\nThere was complete silence in the room, we had 3 very important rules in the house :<br>\n1. Half-Life is the best series out there, everyone has to agree to it.<br>\n2. No discussions about favorite assassins, everyone did their part in saving the world.<br>\n3. No matter how costly alcohol one brings home, old monk should be there.<br><br>\nI was quite shocked as to how could i break a rule that i myself made. We were anyways discussing about new design ideas and as a proof to everyone that this was just a genuine mistake i decided that we will get an assassins creed design featuring all of the assassins (almost all).<br>\nSo here we are with another assassins creed design, doesn''t matter which character you like, you are bound to support it with this assassins creed t shirt.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your favorite assassin in the comments below.<br><br>\nThis assassins creed inspired gamin t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/124/ac_evolution.png', 599, 12, '2018-01-10 21:02:01', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Gaming'),
(125, 'tshirt', 53, 'Half Life', 'I Believe', 'half life 3 gaming t shirts india', 'Wear this half life 3 inspired gaming t shirt and show your support for one of the best gaming franchise ever made. Show your faith in the one free man.', 'It was just another normal drunk night, when all of a sudden my thoughts shifted to ravenholm and city 17 and alyx vance. I just couldn''t control my emotions and we ended up discussing about the possibilities of (what half of the world is waiting for) actually getting half-life 3 in this life span.<br>\nBefore anyone could realise we were divided into two groups (non believers the bigger one). I was really heart broken to see how people were actually starting to forget one of the best things to ever happen to gaming and giving up on the sequel.<br><br>\nI knew right then that I need to do my part in the campaign to make sure the world remembers this legend.<br><br>\nSo here we are with our beliefs perfectly printed on this tee. If you believe in half-life 3 then wear this tee to show the whole world that you still have faith in a bright future.<br><br>\nLet us know if you believe or not in the comments below.<br><br>\nThis Half life 3 inspired gaming t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/125/hl3.png', 599, 7, '2018-01-10 23:34:32', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(126, 'mugs', 52, 'Assassins Creed', 'Choose Your Assassin', 'assassins creed gaming coffee mugs india', 'A lot can happen over a coffee along with an assassin. Get this assassins creed coffee mug.', '11 oz (330 ml) 100% Ceramic mugs with high glossy finish.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your views in the comments below.<br><br>\nThis assassins creed inspired gaming coffee mug is digitally printed using alien technology.', 'images/product/126/ac_evol_right.png', 349, 0, '2018-01-11 15:53:58', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(127, 'mugs', 49, 'Death Note', 'This Is My Cake', 'my cake l death note anime coffee mugs india', 'Have some coffee with L, but don''t look at his cake. A must have for death note anime fans', '11 oz (330 ml) 100% Ceramic mugs with high glossy finish.<br><br>\nDesign By : Anwesha pradhan<br><br>\nLet us know your views in the comments below.<br><br>\nThis death note inspired anime coffee mug is digitally printed using alien technology.', 'images/product/127/my_cake_mug_left.png', 349, 0, '2018-01-11 15:55:51', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(128, 'mugs', 53, 'Half Life', 'I Believe', 'half life gaming coffee mugs india', 'Make sure you take your first sip from this mug every morning and keep faith in the one free man.', '11 oz (330 ml) 100% Ceramic mugs with high glossy finish.<br><br>\nLet us know your views in the comments below.<br><br>\nThis Half-Life 3 inspired gaming coffee mug is digitally printed using alien technology.', 'images/product/128/hl3_mug_left.png', 349, 0, '2018-01-11 15:58:27', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(129, 'posters', 53, 'Half Life', 'I Believe', 'half life 3 gaming posters india', 'Don''t let your faith waver, make sure this is the first thing you see every morning.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis half life inspired poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>', 'images/product/129/hl3_mockup.png', 249, 0, '2018-01-11 16:06:22', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(130, 'posters', 52, 'Assassins Creed', 'Choose Your Assassin', 'assassins creed gamin posters india', 'Whichever is your favorite assassin, we have you covered with this assassins creed poster.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis assassins creed inspired gaming poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>\nDesign By Pratik Bhattacharjee.<br><br>', 'images/product/130/ac_evol.png', 249, 0, '2018-01-11 16:07:39', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Gaming'),
(131, 'posters', 49, 'Death Note', 'This Is My Cake', 'death note anime posters india', 'Make sure you paste this death note inspired poster somewhere so that people can understand the importance of your cake.', 'Dimensions : 12 X 18 inches<br><br>\n250 GSM high quality glossy paper.<br><br>\nThis death note inspired anime poster is printed on a 12 X 18 inches high quality 250 gsm glossy paper.<br><br>\nDesign By Anwesha Pradhan.<br><br>', 'images/product/131/my_cake.png', 249, 0, '2018-01-11 16:20:41', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 0, 'Anime'),
(132, 'tshirt', 54, 'Programming', 'Too Much Caffeine', 'coffee addict geek programming t shirts india', 'Get this quirky programming t shirt to quench the thirst for caffeine in you.', 'When was the last time when this miraculous drug helped you finish your game in one sitting? Maybe, it helped you tremendously in solving that non reproducible run time bug. Whatever the situation might be, this magical elixir have always stepped up to the game (just like goku) and never disappointed any of us (maybe some, who don''t know the right quantity to add).<br><br>\nSo what we want to say is that we just wanted to give the right amount of respect to the only psychoactive drug (which is legal and unregulated), that keeps us running and ticking through out 5 days a week so that we can focus on what really matters to us.<br><br>\n\nWear this caffeine programming t-shirt in front of all those naysayers and show them the wonders of caffeine, show them the true power of caffeine and let them know so that they even remember it in their dreams that "that''s too much caffeine" said no one ever.<br><br>\nLet us know your favorite caffeine moments in the comments below.<br><br>\nThis coffee inspired programming geeky t shirt is digitally printed on a 100% cotton black colored psycho store t shirt.', 'images/product/132/caffeine.png', 499, 4, '2018-03-04 11:49:25', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Programming');
