(133, 'tshirt', 55, 'One Piece', 'Luffys Evolution', 'luffys evolution one piece anime t shirts india', 'Unlock your gears just like luffy did by wearing this one piece anime t shirt.', 'So this one time when i was just pondering over life in general, how life metaphorically seems to be like travelling on a seemingly endless road. That''s when my phone rang, and all this train of thought ran at high speed through my mind which eventually lead to this one piece luffy''s evolution design<br><br>\nYes you guessed it right, my ring tone was the culprit which is the sound of a\n<a target=''blank'' href="http://onepiece.wikia.com/wiki/Den_Den_Mushi">den den mushi</a> which somehow made me think of luffy and how he changes his gears when faced with difficult situations in life and even manages to surpass himself when required.<br><br>\nhence our mind somehow linked these two things together and showed us what luffy actually wants to say. That''s what we get to learn from luffy. but until you find yourself a nice little devil fruit, be satisfied with this one piece luffy''s evolution design.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your favorite luffy''s gear in the comments below.<br><br>\nThis one piece inspired anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/133/luffys_evolution.png', 599, 33, '2018-03-04 18:10:28', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Anime'),
(134, 'tshirt', 59, 'Rick And Morty', 'Tshirt Rick', 'its t-shirt rick and morty cartoon t shirts india', 'Now get your very own version of the t shirt rick with this rick and morty t-shirt.', 'Ever since that pickle rick episode aired and shook the world, we knew that everyone would like to have their own version of pickle rick. But yes, the probability  of people liking pickle over t-shirt would be quite low, so there was no point in bringing out the pickle rick version.<br><br>\n\nOur very clever scientists decided to create tshirt version of rick, so lo and behold we present to you, your very own t-shirt rick<br><br>\n\nDesign by : <a target="_blank" href="https://www.facebook.com/splooshdesign/"> SplooshDesign</a><br><br>\nLet us know your favorite rick moments in the comments below<br><br>\nThis rick and morty inspired t shirt rick is screen printed on a 100% cotton white colored psycho store t shirt.', 'images/product/134/rick_white.png', 599, 9, '2018-03-05 20:59:20', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Cartoon'),
(135, 'tshirt', 58, 'Programming', 'Analog Shit', 'analog shit geek t shirts india', 'Your life is ending one second at a time, don''t waste it on the toilet seat. Get this geeky t shirt and show the world how life is lived.', 'We often used to have these movie or gaming marathon nights. But lately I did some number crunching and came up with the conclusion that our marathon nights are headed towards a downfall and the major reason for this is people spending more than usual time on the toilet seat rather than in front of the screens.<br><br>\n\nCareful analysis into this topic led me to discover that one of the major cause for this is the rise of the digital shit. This is the phenomenon where even after we are done with our shit, we keep on sitting over our shit for a prolonged period of time using one of our digital devices. Some more surveys and research led us to discover that it has increased washroom time by an average of 4 minutes 28 seconds.<br><br>\n\nIt was just another lord of the rings marathon night when i lost my cool and decided to return to the good old days of analog shit. No digital shit on marathon nights, simple.<br>\nNeedless to say this was too god to be not printed on a tee. After all it''s up to us now to save the marathon nights of the world and teach the world how to live  life and fulfill their purpose.<br><br>\nTell us when was your last analog shit in the comments below.<br><br>\nThis analog shit geek t shirt rick is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/135/analog_shit.png', 499, 3, '2018-03-17 09:37:11', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Programming'),
(136, 'tshirt', 56, 'Dragon Ball Z', 'Vegeta Final Flash', 'vegeta final flash dragon ball super anime t shirts india', 'This design is our tribute to vegeta for all his efforts in the tournament of power and showing the whole universe 7 what it means to have the saiyan pride.', 'Brutally honest confession, yes we were definitely goku fanboys, that is why you all see so many goku inspired designs on the site. Never liked vegeta much because of his pride and arrogance. But ever since this tournament of power and his speech to jiren that his saiyan pride is exactly what make him vegeta totally blew us off.<br><br>\nAs the tournament of power comes to an end we had a dilemme to either come up with a mastered ultra instinct design which obviously made sense, but we felt that it is time that we should show our respect towards vegeta for all his efforts and the fight he put up with toppo and jiren.<br><br>\nSo here we are with one of our most intense dragon ball inspired design for vegeta. you truly won our respect and hearts with your saiyan pride and this is our tribute to you.<br><br>\nDesign By : Pratik Bhattacharjee<br><br>\nLet us know your favorite vegeta moments in the comments below.<br><br>\nThis dragon ball super inspired anime t shirt is screen printed on a 100% cotton black colored psycho store t shirt.', 'images/product/136/final_flash.png', 599, 31, '2018-03-23 19:43:49', 'Psycho Store : Use this on a first date, you will rock.', 'live', 'psychofamous', 1, 'Anime');
